		FETCH curLinea INTO Codigo, Nombre, Factor;
        
		IF vDONE THEN
		  LEAVE vLOOP;
		END IF;
        
		SET vOpcion = CONCAT(vOpcion, '<option value="', Codigo, '" factor="' , Factor , '">', Nombre,'</option>');
	END LOOP;

	CLOSE curLinea;
    
	RETURN vOpcion;
END ;;
