CREATE DEFINER=`root`@`%` FUNCTION `FU_COMBO_UNIDAD_ID_BY_PRODUCTO`(
	pPRODUCTO int(11)
) RETURNS varchar(8000) CHARSET utf8
BEGIN
	DECLARE Codigo int(11);
    DECLARE Nombre VARCHAR(100);
    DECLARE Factor DECIMAL(15,4);
    DECLARE vOpcion VARCHAR(8000);
    DECLARE vDONE 		INT DEFAULT FALSE;
	DECLARE curLinea CURSOR FOR SELECT 	  uni.ID_UNIDAD AS Codigo
										, CONCAT(TXT_COD_UND, ' - ', TXT_DESCRIPCION) AS Nombre
                                        , DEC_FACTOR
								FROM 	tbl_unidad_medida uni INNER JOIN 	(
																				(SELECT ID_UNIDAD, DEC_FACTOR FROM tbl_producto_unidades pro WHERE  pro.ID_PRODUCTO = pPRODUCTO ) 
																				UNION
																				(SELECT ID_UNIDAD_MED AS ID_UNIDAD, 1 AS DEC_FACTOR FROM tbl_producto pro WHERE  pro.ID_PRODUCTO = pPRODUCTO ) 
																			) dat ON   uni.ID_UNIDAD = dat.ID_UNIDAD ;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET vDONE = TRUE;

	SET vOpcion = '';
    
	OPEN curLinea;

	vLOOP: LOOP
		FETCH curLinea INTO Codigo, Nombre, Factor;
        
		IF vDONE THEN
		  LEAVE vLOOP;
		END IF;
        
		SET vOpcion = CONCAT(vOpcion, '<option value="', Codigo, '" factor="' , Factor , '">', Nombre,'</option>');
	END LOOP;

	CLOSE curLinea;
    
	RETURN vOpcion;
END ;;
DELIMITER ;
