CREATE DEFINER=`root`@`%` PROCEDURE `sp_actualizarEstados_RespSunat`(
in pFECHA_ENVIO_SUNAT datetime,
in pTICKET_SUNAT varchar(50),
in pFECHA_RECP_SUNAT datetime,
in pFEC_GENE_DOC_SUNAT datetime,
in pCOD_RPTA_ENVIO_SUNAT varchar(10),
in pCOD_ESTADO_SUNAT char(3),
in pCOD_ESTADO_DOC char(2),
in pFLAG_NUM_INT char(2),
in pFLAG_CORREO char(1),
in pFEC_RECP_DOC2 datetime,
in pTXT_RESP char(2),
in pNUM_CPE_FACTURADOR int(11),
in pCOD_CLIENTE_EMIS int(11),
in pCOD_TIP_CPE int(11)
)
BEGIN

	   start transaction;
       
       if (pCOD_TIP_CPE = '09') then
			UPDATE tbl_guia_remision
			SET 
				FECHA_ENVIO_SUNAT =pFECHA_ENVIO_SUNAT, 
                TICKET_ID_RECEP_SUNAT = pTICKET_SUNAT,
				FECHA_RECP_SUNAT = pFECHA_RECP_SUNAT, 
				FEC_GENE_DOC_SUNAT = pFEC_GENE_DOC_SUNAT,
				COD_RPTA_ENVIO_SUNAT = pCOD_RPTA_ENVIO_SUNAT, 
				COD_ESTADO_SUNAT = pCOD_ESTADO_SUNAT,
				COD_ESTADO_DOC = pCOD_ESTADO_DOC
                
				-- FLAG_NUM_INT = pFLAG_NUM_INT,
				-- FLAG_CORREO = pFLAG_CORREO, 
				-- FEC_RECP_DOC2 = pFEC_RECP_DOC2, 
				-- TXT_RESP = pTXT_RESP
			WHERE 
				ID_GUIA = pNUM_CPE_FACTURADOR and 
                ID_EMISOR = pCOD_CLIENTE_EMIS;
       else
			UPDATE tbl_cpe_cabecera
			SET FECHA_ENVIO_SUNAT =pFECHA_ENVIO_SUNAT, TICKET_ID_RECEP_SUNAT = pTICKET_SUNAT,
			FECHA_RECP_SUNAT = pFECHA_RECP_SUNAT, FEC_GENE_DOC_SUNAT = pFEC_GENE_DOC_SUNAT,
			COD_RPTA_ENVIO_SUNAT = pCOD_RPTA_ENVIO_SUNAT, COD_ESTADO_SUNAT = pCOD_ESTADO_SUNAT,
			COD_ESTADO_DOC = pCOD_ESTADO_DOC, FLAG_NUM_INT = pFLAG_NUM_INT,
			FLAG_CORREO = pFLAG_CORREO, FEC_RECP_DOC2 = pFEC_RECP_DOC2, TXT_RESP = pTXT_RESP
			WHERE NUM_CPE = pNUM_CPE_FACTURADOR and COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS;
       end if;

       
       
	   commit;

END ;;
DELIMITER ;
