CREATE DEFINER=`root`@`%` PROCEDURE `Sp_ACTUALIZARPARAETROSSUNAT`(in pusuariosunat varchar(100)
, in  ppasssunat varchar(100), in  pcorreo varchar(100), in ppasscorreo varchar(100),
in psmptp varchar(100) , in ppuerto varchar(100), in pssl varchar(100), in pcorreo_contri varchar(100), in pcliente int(16))
BEGIN
  start transaction;
  update tbl_cliente_parametros set TXT_VALOR_PARAMETRO = case COD_PARAMETRO 
	when '004' then pusuariosunat
    when '005' then ppasssunat
    when '007' then pcorreo
    when '008' then ppasscorreo
    when '009' then psmptp
    when '010' then ppuerto
	when '024' then pssl 
    when '025' then pcorreo_contri end 
	where COD_PARAMETRO in ('004','005','007','008','009','010','024','025') and COD_EMISOR = pcliente;
  commit;
END ;;
DELIMITER ;
