CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_GUIA_REMISION`(
	  pGUIA 					int(11)
	, pDESTINATARIO 			int(11)
	, pRUC_DESTINATARIO 		varchar(11)
	, pNOMBRE_DESTINATARIO 		varchar(120)
	, pDIRECCION_DESTINATARIO 	varchar(120)
	, pTRASLADO 				datetime
	, pDOMICILIO_PARTIDA 		varchar(150)
	, pDOMICILIO_LLEGADA 		varchar(150)
	, pMOTIVO 					int(11)
	, pNOMBRE_TRANS 			varchar(50)
	, pRUC_TRANS 				varchar(11)
	, pVEHICULO 				varchar(20)
	, pPLACA 					varchar(8)
	, pLICENCIA 				varchar(20)
	, pCERTIFICADO_INS 			varchar(20)
	, pORDEN_COMPRA 			varchar(20)
	, pFACTURAT 				varchar(20)
	, pFACTURAI					int(11)
	, pOBSERVACION				varchar(150)
	, pUSUARIO 					bigint(20)
	, pEMISOR 					int(11)
    , pALMACEN_PART				int(11)
    , pALMACEN_LLEG				int(11)
    , pRES_SERIE				varchar(4)
    , pRES_CORRELATIVO			varchar(8)
    , pLOCAL					varchar(5)
    , pSERIE					varchar(4)
	, pTIPDOC					char(1)
    , pTRANS_CONDUCT_COD_TIP_NIF char(1)
    , pTRANS_CONDUCT_NUM_IDEN varchar(20)
)
BEGIN
	DECLARE proceso varchar(1);
	DECLARE vFactura INT;
    DECLARE vOtro INT;
	DECLARE vSERIE 		VARCHAR(4) DEFAULT 'GU00';
	DECLARE vCODIGO 	varchar(12);
	DECLARE vDONE 		INT DEFAULT FALSE;
	DECLARE vPRODUCTO 	INT(11);
    DECLARE vCANTIDAD  	DECIMAL(13,2);
	DECLARE curLinea CURSOR FOR SELECT     Deta.ID_PRODUCTO
										 , (Deta.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1)) AS DEC_CANTIDAD
								FROM 	 tbl_guia_remision_detalle Deta LEFT OUTER JOIN tbl_producto_unidades PrUn ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO AND Deta.ID_UNIDAD = PrUn.ID_UNIDAD
								WHERE 	 Deta.ID_GUIA = pGUIA
								ORDER BY Deta.ID_PRODUCTO, INT_LINEA;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET vDONE = TRUE;
	
    start transaction;
    
    SET vFactura = 0;
    SELECT 	COUNT(*) INTO vFactura
    FROM 	tbl_guia_remision_detalle
    WHERE 	ID_CPE_DETALLE IS NULL AND ID_GUIA = pGUIA;
    
    SET vSERIE = pSERIE;
    CALL SP_OBTENER_NUEVO_COD_SERIE(vSERIE, pEMISOR, vCODIGO);
    
    UPDATE 	tbl_guia_remision
    SET		  TXT_SERIE = vSERIE
			, TXT_CORRELATIVO = vCODIGO
			, ID_DESTINATARIO = pDESTINATARIO
			, TXT_RUC_DESTINATARIO = pRUC_DESTINATARIO
			, TXT_NOMBRE_DESTINATARIO = pNOMBRE_DESTINATARIO
			, TXT_DIRECCION_DESTINATARIO = pDIRECCION_DESTINATARIO
			, FEC_EMISION = now()
			, FEC_TRASLADO = pTRASLADO
			, TXT_DOMICILIO_PARTIDA = pDOMICILIO_PARTIDA
			, TXT_DOMICILIO_LLEGADA = pDOMICILIO_LLEGADA
			, ID_MOTIVO = pMOTIVO
			, TXT_NOMBRE_TRANS = pNOMBRE_TRANS
			, TXT_RUC_TRANS = pRUC_TRANS
			, TXT_VEHICULO = pVEHICULO
			, TXT_PLACA = pPLACA
			, TXT_LICENCIA = pLICENCIA
			, TXT_CERTIFICADO_INS = pCERTIFICADO_INS
			, TXT_ORDEN_COMPRA = pORDEN_COMPRA
			, TXT_FACTURA = if( pRES_SERIE = '', pFACTURAT, concat(pRES_SERIE, '-', pRES_CORRELATIVO))
			, ID_FACTURA = pFACTURAI
			, TXT_OBSERVACION = pOBSERVACION
			, ID_USUARIO = pUSUARIO
			, BIT_NUEVO = 0
            , ID_ALMACEN_PART = pALMACEN_PART
            , ID_ALMACEN_LLEG = pALMACEN_LLEG
            , TXT_RES_SERIE	= pRES_SERIE
			, TXT_RES_CORRELATIVO = pRES_CORRELATIVO
            , COD_LOCAL = pLOCAL
            , CHR_ESTADO = '01'
            , BIT_FACTURADO = NOT (vFactura > 0)
            , TIP_DOC = pTIPDOC
            , FLAG_CARGA = '0'
            , COD_ESTADO_DOC = '02'
            , COD_ESTADO_SUNAT = '101'
            , TRANS_CONDUCT_COD_TIP_NIF = pTRANS_CONDUCT_COD_TIP_NIF
            , TRANS_CONDUCT_NUM_IDEN = pTRANS_CONDUCT_NUM_IDEN
            , TRANS_COD_TIP_NIF = '6'
            , NUM_RUC_PROV = '20131312955'
            , NOM_RZN_SOC_PROV = 'PROVEEDOR GENERICO'
            , COD_TIP_NIF_PROV = '6'
    WHERE	ID_GUIA = pGUIA
		AND ID_EMISOR = pEMISOR
        AND BIT_NUEVO = 1;
	
    if (NOT pRES_SERIE IS NULL AND NOT pRES_CORRELATIVO IS NULL) then
		INSERT INTO tbl_cpe_cabecera 
			(
				  COD_TIP_CPE
				, COD_ESTADO_DOC
				, COD_CLIENTE_EMIS
				, TXT_SERIE
				, TXT_CORRELATIVO
				, FEC_EMIS
				, ID_USUARIO
				, FLAG_CARGA
				, ESTAD_ITEM
                , COD_IDEN_CB
			)
		VALUES
			(
				  '01'
				, '06'
				, pEMISOR
				, pRES_SERIE
				, pRES_CORRELATIVO
				, now()
				, pUSUARIO
				, 1
				, 0
                , ''
			);
	end if;
    
    SET proceso = null;
                    
	select  TXT_VALOR_PARAMETRO into proceso
	from	tbl_cliente_parametros
	where 	COD_PARAMETRO = '037' and COD_EMISOR = pEMISOR;
	
	if (proceso = 'I' AND proceso is not null) then
		if (vFactura > 0) then
		UPDATE 	tbl_inventario Inve
		JOIN  	(	SELECT    Deta.ID_UBICACION
							, Guia.ID_EMISOR
							, Deta.ID_PRODUCTO
							, Deta.TXT_LOTE
							, Deta.FEC_VENCIMIENTO
							, SUM((Deta.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1))) AS DEC_CANTIDAD
					FROM 	tbl_guia_remision Guia  INNER JOIN tbl_guia_remision_detalle Deta ON Guia.ID_GUIA = Deta.ID_GUIA
																							 AND Guia.ID_GUIA = pGUIA
																							 AND Guia.ID_EMISOR = pEMISOR
													LEFT OUTER JOIN tbl_producto_unidades PrUn ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO
																							  AND Deta.ID_UNIDAD = PrUn.ID_UNIDAD
					GROUP BY  Guia.ID_EMISOR
							, Deta.ID_UBICACION
							, Deta.ID_PRODUCTO
							, Deta.TXT_LOTE
							, Deta.FEC_VENCIMIENTO ) GRDe  ON   GRDe.ID_PRODUCTO = Inve.ID_PRODUCTO
															AND GRDe.ID_UBICACION = Inve.ID_UBICACION
															AND GRDe.TXT_LOTE = Inve.TXT_LOTE
															AND IFNULL(GRDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
															AND GRDe.ID_EMISOR = Inve.ID_EMISOR
		SET  	Inve.NUM_CANTIDAD = Inve.NUM_CANTIDAD - GRDe.DEC_CANTIDAD
		WHERE	Inve.ID_EMISOR = pEMISOR;
		
		IF (pMOTIVO != 8) THEN
			UPDATE 	tbl_producto Prod
			JOIN  	(	SELECT    Guia.ID_EMISOR
								, Deta.ID_PRODUCTO
								, SUM((Deta.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1))) AS DEC_CANTIDAD
						FROM 	tbl_guia_remision Guia 	INNER JOIN tbl_guia_remision_detalle Deta ON Guia.ID_GUIA = Deta.ID_GUIA
																								 AND Guia.ID_GUIA = pGUIA
																								 AND Guia.ID_EMISOR = pEMISOR
														LEFT OUTER JOIN tbl_producto_unidades PrUn ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO
																								 AND Deta.ID_UNIDAD = PrUn.ID_UNIDAD
						GROUP BY  Guia.ID_EMISOR
								, Deta.ID_PRODUCTO ) GRDe  ON   GRDe.ID_PRODUCTO = Prod.ID_PRODUCTO
															AND GRDe.ID_EMISOR = Prod.ID_EMISOR
			SET  	Prod.DEC_STOCK = Prod.DEC_STOCK - GRDe.DEC_CANTIDAD
			WHERE	Prod.ID_EMISOR = pEMISOR;
		END IF;

		OPEN curLinea;

		SET vDONE = FALSE;
		vLOOP: LOOP
			FETCH curLinea INTO vPRODUCTO, vCANTIDAD;
			IF vDONE THEN
			  LEAVE vLOOP;
			END IF;	
            
			CALL SP_INSERTAR_INV_MOVIMIENTO
			(
				  pEMISOR
				, vPRODUCTO
				, (SELECT ID_TIPO_MOV FROM tbl_motivo_traslado WHERE ID_MOTIVO = pMOTIVO LIMIT 1)
				, 5
				, vSERIE
				, vCODIGO
				, vCANTIDAD
				, 0
				, 0
				, pGUIA
				, pUSUARIO
			);
			
			IF (pMOTIVO = 8) THEN
				CALL SP_INSERTAR_INV_MOVIMIENTO
				(
					  pEMISOR
					, vPRODUCTO
					, 11
					, 5
					, vSERIE
					, vCODIGO
					, vCANTIDAD
					, 0
					, 1
					, pGUIA
					, pUSUARIO
				);
			END IF;
		END LOOP;

		CLOSE curLinea;
		
		
		IF (pMOTIVO = 8) THEN
			UPDATE 	tbl_inventario Inve
			JOIN  	(	SELECT    Deta.ID_UBICACION_DEST
								, Guia.ID_EMISOR
								, Deta.ID_PRODUCTO
								, Deta.TXT_LOTE
								, Deta.FEC_VENCIMIENTO
								, SUM((Deta.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1))) AS DEC_CANTIDAD
					FROM 	tbl_guia_remision Guia  INNER JOIN tbl_guia_remision_detalle Deta ON Guia.ID_GUIA = Deta.ID_GUIA
																							 AND Guia.ID_GUIA = pGUIA
																							 AND Guia.ID_EMISOR = pEMISOR
													LEFT OUTER JOIN tbl_producto_unidades PrUn ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO
																							  AND Deta.ID_UNIDAD = PrUn.ID_UNIDAD
						GROUP BY  Guia.ID_EMISOR
								, Deta.ID_UBICACION_DEST
								, Deta.ID_PRODUCTO
								, Deta.TXT_LOTE
								, Deta.FEC_VENCIMIENTO ) GRDe  ON   GRDe.ID_PRODUCTO = Inve.ID_PRODUCTO
																AND GRDe.ID_UBICACION_DEST = Inve.ID_UBICACION
																AND GRDe.TXT_LOTE = Inve.TXT_LOTE
																AND IFNULL(GRDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
																AND GRDe.ID_EMISOR = Inve.ID_EMISOR
			SET  	Inve.NUM_CANTIDAD = Inve.NUM_CANTIDAD + GRDe.DEC_CANTIDAD
			WHERE	Inve.ID_EMISOR = pEMISOR;
			
			INSERT INTO tbl_inventario
			(
				  ID_EMISOR
				, ID_UBICACION
				, ID_PRODUCTO
				, TXT_LOTE
				, NUM_CANTIDAD
				, FEC_VENCIMIENTO
			)
			(
				SELECT 	  EnDe.ID_EMISOR
						, EnDe.ID_UBICACION_DEST
						, EnDe.ID_PRODUCTO
						, EnDe.TXT_LOTE
						, EnDe.DEC_CANTIDAD
						, EnDe.FEC_VENCIMIENTO
				FROM 	(
							SELECT    Deta.ID_UBICACION_DEST
									, Guia.ID_EMISOR
									, Deta.ID_PRODUCTO
									, Deta.TXT_LOTE
									, Deta.FEC_VENCIMIENTO
									, SUM((Deta.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1))) AS DEC_CANTIDAD
							FROM 	tbl_guia_remision Guia  INNER JOIN tbl_guia_remision_detalle Deta ON Guia.ID_GUIA = Deta.ID_GUIA
																									 AND Guia.ID_GUIA = pGUIA
																									 AND Guia.ID_EMISOR = pEMISOR
															LEFT OUTER JOIN tbl_producto_unidades PrUn ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO
																									  AND Deta.ID_UNIDAD = PrUn.ID_UNIDAD
							GROUP BY  Guia.ID_EMISOR
									, Deta.ID_UBICACION_DEST
									, Deta.ID_PRODUCTO
									, Deta.TXT_LOTE
									, Deta.FEC_VENCIMIENTO ) EnDe LEFT OUTER JOIN tbl_inventario Inve ON    EnDe.ID_PRODUCTO = Inve.ID_PRODUCTO
																										AND EnDe.ID_UBICACION_DEST = Inve.ID_UBICACION
																										AND EnDe.TXT_LOTE = Inve.TXT_LOTE
																										AND IFNULL(EnDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
																										AND EnDe.ID_EMISOR = Inve.ID_EMISOR
				WHERE Inve.ID_PRODUCTO IS NULL
			);
		END IF;
	ELSE
		UPDATE 	tbl_cpe_det_cabecera Deta INNER JOIN tbl_guia_remision_detalle Guia ON Deta.NUM_DET_CABECERA = Guia.ID_CPE_DETALLE AND Guia.ID_GUIA = pGUIA
										  LEFT OUTER JOIN tbl_producto_unidades PrUn ON Guia.ID_PRODUCTO = PrUn.ID_PRODUCTO
																					AND Guia.ID_UNIDAD = PrUn.ID_UNIDAD
		SET 	Deta.CANT_UNID_GR = Deta.CANT_UNID_GR + (Guia.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1));
		
		SET vOtro = 0;
		SELECT 	Cabe.NUM_CPE INTO vOtro
		FROM 	tbl_guia_remision_detalle Deta INNER JOIN tbl_cpe_det_cabecera Cabe ON Cabe.NUM_DET_CABECERA = Deta.ID_CPE_DETALLE AND Deta.ID_GUIA = pGUIA
		WHERE 	ID_GUIA = pGUIA LIMIT 1;

		UPDATE 	tbl_cpe_cabecera
		SET 	BIT_GUIA = (SELECT (COUNT(*) = 0) FROM tbl_cpe_det_cabecera  Deta WHERE Deta.NUM_CPE = vOtro AND Deta.CANT_UNID_ITEM > Deta.CANT_UNID_GR)
		WHERE 	NUM_CPE = vOtro;
        
        CALL SP_INSERTAR_RELACION_FAC_GUIA(vOtro, pGUIA, 0);
	END IF;
    end if;
    commit;
END ;;
DELIMITER ;
