CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_GUIA_REMISION_DETALLE`(
	  pGUIA 		int(11)
	, pLINEA 		int(11)
	, pPRODUCTO 	int(11)
	, pCODIGO_PROD 	varchar(30)
	, pNOMBRE_PROD 	varchar(150)
	, pUNIDAD 		int(11)
	, pCANTIDAD 	decimal(13,2)
	, pPESO 		decimal(13,2)
	, pOBSERVACION 	varchar(60)
    , pLOTE 		varchar(20)
	, pVECIMIENTO 	datetime
	, pUBICACION 	int(11)
    , pSERIE		varchar(50)
    , pUNIDAD_PESO	int(11)
    , pUBICACION_DEST int(11)

)
BEGIN
	DECLARE vCantidad INT;

	SELECT 	COUNT(*) INTO vCantidad
	FROM	tbl_guia_remision_detalle
	WHERE	ID_GUIA = pGUIA
		AND INT_LINEA = pLINEA;    

    IF vCantidad = 0 THEN
        INSERT INTO tbl_guia_remision_detalle
        (
			  ID_GUIA
			, INT_LINEA
			, ID_PRODUCTO
			, TXT_CODIGO_PROD
			, TXT_NOMBRE_PROD
			, ID_UNIDAD
			, DEC_CANTIDAD
			, DEC_PESO
			, TXT_OBSERVACION
            , TXT_LOTE
			, FEC_VENCIMIENTO
			, ID_UBICACION
            , TXT_SERIE
            , ID_UNIDAD_PESO
            , ID_UBICACION_DEST
        )
        VALUES
        (
			  pGUIA
			, pLINEA
			, pPRODUCTO
			, pCODIGO_PROD
			, pNOMBRE_PROD
			, pUNIDAD
			, pCANTIDAD
			, pPESO
			, pOBSERVACION
            , pLOTE
			, pVECIMIENTO
			, pUBICACION
            , pSERIE
            , pUNIDAD_PESO
            , pUBICACION_DEST
        );
	ELSE
		UPDATE 	tbl_guia_remision_detalle
        SET		  ID_PRODUCTO = pPRODUCTO
				, TXT_CODIGO_PROD = pCODIGO_PROD
				, TXT_NOMBRE_PROD = pNOMBRE_PROD
				, ID_UNIDAD = pUNIDAD
				, DEC_CANTIDAD = pCANTIDAD
				, DEC_PESO = pPESO
				, TXT_OBSERVACION = pOBSERVACION
                , TXT_LOTE = pLOTE
				, FEC_VENCIMIENTO = pVECIMIENTO
				, ID_UBICACION = pUBICACION
                , TXT_SERIE = pSERIE
                , ID_UNIDAD_PESO = pUNIDAD_PESO
                , ID_UBICACION_DEST = pUBICACION_DEST
        WHERE	ID_GUIA = pGUIA
			AND INT_LINEA = pLINEA;
    END IF;
END ;;
DELIMITER ;
