CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_INV_ENTRADA`(
	  pENTRADA int(11)
	, pTIP_MOV int(11)
	, pALMACEN int(11)
	, pTIPO_DOC varchar(4)
	, pNUM_DOC varchar(45)
	, pFILE_DOC varchar(100)
	, pREF_NOMBRE varchar(50)
	, pREF_FILE varchar(100)
	, pPROVEEDOR int(11)
	, pRUC_PROV varchar(11)
	, pNOM_PROV varchar(120)
	, pDIRECC_PROV varchar(120)
	, pUSUARIO bigint(20)
	, pEMISOR int(11)
	, pOBSERVACION varchar(200)
    , pFILE_DOC_NOMBRE varchar(100)
    , pFILE_REF_NOMBRE varchar(100)
    , pSERIE varchar(4)
)
BEGIN
	DECLARE vSERIE 		VARCHAR(4) DEFAULT 'CE00';
	DECLARE vCODIGO 	varchar(12);
	DECLARE vDONE 		INT DEFAULT FALSE;
	DECLARE vPRODUCTO 	INT(11);
    DECLARE vCANTIDAD  	DECIMAL(13,2);
    DECLARE vCOSTO_UNI	DECIMAL(13,2);
	DECLARE curLinea CURSOR FOR SELECT     ID_PRODUCTO
										 , DEC_CANTIDAD 
										 , DEC_COSTO_UNI
								FROM 	 tbl_inv_entrada_detalle
								WHERE 	 ID_ENTRADA = pENTRADA
								ORDER BY ID_PRODUCTO, INT_LINEA;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET vDONE = TRUE;
	
    start transaction;
    
    SET vSERIE = pSERIE;
    CALL SP_OBTENER_NUEVO_COD_SERIE(vSERIE, pEMISOR, vCODIGO);
    
    UPDATE 	tbl_inv_entrada
    SET		  TXT_SERIE = vSERIE
			, TXT_CORRELATIVO = vCODIGO
			, ID_TIP_MOV = pTIP_MOV
			, ID_ALMACEN = pALMACEN
			, ID_TIPO_DOC = pTIPO_DOC
			, TXT_NUM_DOC = pNUM_DOC
			, TXT_FILE_DOC = pFILE_DOC
			, TXT_REF_NOMBRE = pREF_NOMBRE
			, TXT_REF_FILE = pREF_FILE
			, ID_PROVEEDOR = pPROVEEDOR
			, TXT_RUC_PROV = pRUC_PROV
			, TXT_NOM_PROV = pNOM_PROV
			, TXT_DIRECC_PROV = pDIRECC_PROV
			, FEC_INGRESO = now()
			, ID_USUARIO = pUSUARIO
			, BIT_NUEVO = 0
			, TXT_OBSERVACION = pOBSERVACION
            , TXT_FILE_DOC_NOMBRE = pFILE_DOC_NOMBRE
            , TXT_FILE_REF_NOMBRE = pFILE_REF_NOMBRE
    WHERE	ID_ENTRADA = pENTRADA
		AND ID_EMISOR = pEMISOR
        AND BIT_NUEVO = 1;
        
        
	UPDATE 	tbl_inventario Inve
	JOIN  	(	SELECT    Deta.ID_UBICACION
						, Entr.ID_EMISOR
						, Deta.ID_PRODUCTO
						, Deta.TXT_LOTE
						, Deta.FEC_VENCIMIENTO
						, SUM(Deta.DEC_CANTIDAD) AS DEC_CANTIDAD
				FROM 	tbl_inv_entrada Entr INNER JOIN tbl_inv_entrada_detalle Deta ON Entr.ID_ENTRADA = Deta.ID_ENTRADA 
																					AND Entr.ID_ENTRADA = pENTRADA
																					AND Entr.ID_EMISOR = pEMISOR
				GROUP BY  Entr.ID_EMISOR
						, Deta.ID_UBICACION
						, Deta.ID_PRODUCTO
						, Deta.TXT_LOTE
						, Deta.FEC_VENCIMIENTO ) EnDe  ON   EnDe.ID_PRODUCTO = Inve.ID_PRODUCTO
														AND EnDe.ID_UBICACION = Inve.ID_UBICACION
														AND EnDe.TXT_LOTE = Inve.TXT_LOTE
														AND IFNULL(EnDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
														AND EnDe.ID_EMISOR = Inve.ID_EMISOR
	SET  	Inve.NUM_CANTIDAD = Inve.NUM_CANTIDAD + EnDe.DEC_CANTIDAD
	WHERE	Inve.ID_EMISOR = pEMISOR;
        
	INSERT INTO tbl_inventario
    (
		  ID_EMISOR
		, ID_UBICACION
		, ID_PRODUCTO
		, TXT_LOTE
		, NUM_CANTIDAD
		, FEC_VENCIMIENTO
    )
    (
		SELECT 	  EnDe.ID_EMISOR
				, EnDe.ID_UBICACION
				, EnDe.ID_PRODUCTO
				, EnDe.TXT_LOTE
				, EnDe.DEC_CANTIDAD
				, EnDe.FEC_VENCIMIENTO
		FROM 	(
					SELECT    Deta.ID_UBICACION
							, Entr.ID_EMISOR
							, Deta.ID_PRODUCTO
							, Deta.TXT_LOTE
							, Deta.FEC_VENCIMIENTO
							, SUM(Deta.DEC_CANTIDAD) AS DEC_CANTIDAD
					FROM 	tbl_inv_entrada Entr INNER JOIN tbl_inv_entrada_detalle Deta ON Entr.ID_ENTRADA = Deta.ID_ENTRADA 
																						AND Entr.ID_ENTRADA = pENTRADA
																						AND Entr.ID_EMISOR = pEMISOR
					GROUP BY  Entr.ID_EMISOR
							, Deta.ID_UBICACION
							, Deta.ID_PRODUCTO
							, Deta.TXT_LOTE
							, Deta.FEC_VENCIMIENTO ) EnDe LEFT OUTER JOIN tbl_inventario Inve ON    EnDe.ID_PRODUCTO = Inve.ID_PRODUCTO
																								AND EnDe.ID_UBICACION = Inve.ID_UBICACION
																								AND EnDe.TXT_LOTE = Inve.TXT_LOTE
																								AND IFNULL(EnDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
																								AND EnDe.ID_EMISOR = Inve.ID_EMISOR
		WHERE Inve.ID_PRODUCTO IS NULL
	);
    
	UPDATE 	tbl_producto Prod
	JOIN  	(	SELECT    Entr.ID_EMISOR
						, Deta.ID_PRODUCTO
						, SUM(Deta.DEC_CANTIDAD) AS DEC_CANTIDAD
				FROM 	tbl_inv_entrada Entr INNER JOIN tbl_inv_entrada_detalle Deta ON Entr.ID_ENTRADA = Deta.ID_ENTRADA 
																					AND Entr.ID_ENTRADA = pENTRADA
																					AND Entr.ID_EMISOR = pEMISOR
				GROUP BY  Entr.ID_EMISOR
						, Deta.ID_PRODUCTO ) EnDe  ON   EnDe.ID_PRODUCTO = Prod.ID_PRODUCTO
													AND EnDe.ID_EMISOR = Prod.ID_EMISOR
	SET  	Prod.DEC_STOCK = Prod.DEC_STOCK + EnDe.DEC_CANTIDAD
	WHERE	Prod.ID_EMISOR = pEMISOR;


	OPEN curLinea;

	SET vDONE = FALSE;
	vLOOP: LOOP
		FETCH curLinea INTO vPRODUCTO, vCANTIDAD, vCOSTO_UNI;
		IF vDONE THEN
		  LEAVE vLOOP;
		END IF;
        
		CALL SP_INSERTAR_INV_MOVIMIENTO
        (
			  pEMISOR
			, vPRODUCTO
			, pTIP_MOV
			, pTIPO_DOC
			, vSERIE
			, vCODIGO
			, vCANTIDAD
			, vCOSTO_UNI
			, 1
			, pENTRADA
			, pUSUARIO
        );
	END LOOP;

	CLOSE curLinea;
    
    commit;
END ;;
DELIMITER ;
