CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_INV_ENTRADA_DETALLE`(
	  pENTRADA 		int(11)
	, pLINEA 		int(11)
	, pPRODUCTO 	int(11)
	, pCODIGO 		varchar(30)
	, pNOMBRE 		varchar(150)
	, pUNIDAD_ING 	int(11)
	, pCOSTO_UNI 	decimal(13,2)
	, pCANTIDAD 	decimal(13,2)
	, pSUBTOTAL 	decimal(13,2)
    , pLOTE 		varchar(20)
	, pVENCIMIENTO 	datetime
    , pUBICACION	int(11)
)
BEGIN
	DECLARE vCantidad INT;

	SELECT 	COUNT(*) INTO vCantidad
	FROM	tbl_inv_entrada_detalle
	WHERE	ID_ENTRADA = pENTRADA
		AND INT_LINEA = pLINEA;    

    IF vCantidad = 0 THEN
        INSERT INTO tbl_inv_entrada_detalle
        (
			  ID_ENTRADA
			, INT_LINEA
			, ID_PRODUCTO
			, TXT_CODIGO
			, TXT_NOMBRE
			, ID_UNIDAD_ING
			, DEC_COSTO_UNI
			, DEC_CANTIDAD
			, DEC_SUBTOTAL
            , TXT_LOTE
			, FEC_VENCIMIENTO
            , ID_UBICACION
        )
        VALUES
        (
			  pENTRADA
			, pLINEA
			, pPRODUCTO
			, pCODIGO
			, pNOMBRE
			, pUNIDAD_ING
			, pCOSTO_UNI
			, pCANTIDAD
			, pCOSTO_UNI * pCANTIDAD
            , pLOTE
			, pVENCIMIENTO
            , pUBICACION
        );
	ELSE
		UPDATE 	tbl_inv_entrada_detalle
        SET		  ID_PRODUCTO = pPRODUCTO
				, TXT_CODIGO = pCODIGO
				, TXT_NOMBRE = pNOMBRE
				, ID_UNIDAD_ING = pUNIDAD_ING
				, DEC_COSTO_UNI = pCOSTO_UNI
				, DEC_CANTIDAD = pCANTIDAD
				, DEC_SUBTOTAL = pCOSTO_UNI * pCANTIDAD
                , TXT_LOTE = pLOTE
				, FEC_VENCIMIENTO = pVENCIMIENTO
                , ID_UBICACION = pUBICACION
        WHERE	ID_ENTRADA = pENTRADA
			AND INT_LINEA = pLINEA;
    END IF;
END ;;
DELIMITER ;
