CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_INV_SALIDA`(
	  pSALIDA 			int(11)
	, pTIPO_MOV 		int(11)
	, pREF_NOMBRE 		varchar(20)
	, pREF_FILE			varchar(40)
	, pALMACEN 			int(11)
	, pUBICACION 		int(11)
	, pADQ 				int(11)
	, pNUM_IDEN_ADQ 	varchar(20)
	, pNOMBRE_ADQ 		varchar(120)
	, pDIRECCION_ADQ 	varchar(120)
	, pTRANSPORTISTA 	varchar(120)
	, pLICENCIA 		varchar(30)
	, pPLACA 			varchar(15)
	, pVEHICULO 		varchar(100)
	, pOBSERVACION 		varchar(120)
	, pUSUARIO 			bigint(20)
	, pEMISOR 			int(11)
)
BEGIN
	DECLARE vSERIE 		VARCHAR(4) DEFAULT 'CS00';
	DECLARE vCODIGO varchar(12);
	DECLARE vDONE 		INT DEFAULT FALSE;
	DECLARE vPRODUCTO 	INT(11);
    DECLARE vCANTIDAD  	DECIMAL(13,2);
    DECLARE vCOSTO_UNI	DECIMAL(13,2);
	DECLARE curLinea CURSOR FOR SELECT     ID_PRODUCTO
										 , DEC_CANTIDAD 
										 , DEC_COSTO
								FROM 	 tbl_inv_salida_detalle
								WHERE 	 ID_SALIDA = pSALIDA
								ORDER BY ID_PRODUCTO, INT_LINEA;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET vDONE = TRUE;
	
    start transaction;
    
    CALL SP_OBTENER_NUEVO_COD_SERIE(vSERIE, 1, vCODIGO);
    
    UPDATE 	tbl_inv_salida
    SET		  ID_TIPO_MOV = pTIPO_MOV
			, TXT_SERIE = vSERIE
			, TXT_CORRELATIVO = vCODIGO
			, TXT_REF_NOMBRE = pREF_NOMBRE
			, TXT_REF_FILE = pREF_FILE
			, ID_ALMACEN = pALMACEN
			, ID_UBICACION = pUBICACION
			, ID_ADQ = pADQ
			, TXT_NUM_IDEN_ADQ = pNUM_IDEN_ADQ
			, TXT_NOMBRE_ADQ = pNOMBRE_ADQ
			, TXT_DIRECCION_ADQ = pDIRECCION_ADQ
			, TXT_TRANSPORTISTA = pTRANSPORTISTA
			, TXT_LICENCIA = pLICENCIA
			, TXT_PLACA = pPLACA
			, TXT_VEHICULO = pVEHICULO
			, TXT_OBSERVACION = pOBSERVACION
			, FEC_INGRESO = now()
			, ID_USUARIO = pUSUARIO
			, BIT_NUEVO = 0
    WHERE	ID_SALIDA = pSALIDA
		AND ID_EMISOR = pEMISOR
        AND BIT_NUEVO = 1;
        
        
	UPDATE 	tbl_inventario Inve
	JOIN  	(	SELECT    Sali.ID_UBICACION
						, Sali.ID_EMISOR
						, Deta.ID_PRODUCTO
						, Deta.TXT_LOTE
						, Deta.FEC_VENCIMIENTO
						, SUM(Deta.DEC_CANTIDAD) AS DEC_CANTIDAD
				FROM 	tbl_inv_salida Sali INNER JOIN tbl_inv_salida_detalle Deta ON   Sali.ID_SALIDA = Deta.ID_SALIDA 
																					AND Sali.ID_SALIDA = pSALIDA
																					AND Sali.ID_EMISOR = pEMISOR
				GROUP BY  Sali.ID_EMISOR
						, Sali.ID_UBICACION
						, Deta.ID_PRODUCTO
						, Deta.TXT_LOTE
						, Deta.FEC_VENCIMIENTO ) SaDe  ON   SaDe.ID_PRODUCTO = Inve.ID_PRODUCTO
														AND SaDe.ID_UBICACION = Inve.ID_UBICACION
														AND SaDe.TXT_LOTE = Inve.TXT_LOTE
														AND IFNULL(SaDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
														AND SaDe.ID_EMISOR = Inve.ID_EMISOR
	SET  	Inve.NUM_CANTIDAD = Inve.NUM_CANTIDAD - SaDe.DEC_CANTIDAD
	WHERE	Inve.ID_EMISOR = pEMISOR;
           
	UPDATE 	tbl_producto Prod
	JOIN  	(	SELECT    Sali.ID_EMISOR
						, Deta.ID_PRODUCTO
						, SUM(Deta.DEC_CANTIDAD) AS DEC_CANTIDAD
				FROM 	tbl_inv_salida Sali INNER JOIN tbl_inv_salida_detalle Deta ON   Sali.ID_SALIDA = Deta.ID_SALIDA 
																					AND Sali.ID_SALIDA = pSALIDA
																					AND Sali.ID_EMISOR = pEMISOR
				GROUP BY  Sali.ID_EMISOR
						, Deta.ID_PRODUCTO ) SaDe  ON   SaDe.ID_PRODUCTO = Prod.ID_PRODUCTO
													AND SaDe.ID_EMISOR = Prod.ID_EMISOR
	SET  	Prod.DEC_STOCK = Prod.DEC_STOCK - SaDe.DEC_CANTIDAD
	WHERE	Prod.ID_EMISOR = pEMISOR;

	OPEN curLinea;

	vLOOP: LOOP
		FETCH curLinea INTO vPRODUCTO, vCANTIDAD, vCOSTO_UNI;
        
		IF vDONE THEN
		  LEAVE vLOOP;
		END IF;
        
		CALL SP_INSERTAR_INV_MOVIMIENTO
        (
			  pEMISOR
			, vPRODUCTO
			, pTIPO_MOV
			, 1
			, vSERIE
			, vCODIGO
			, vCANTIDAD
			, vCOSTO_UNI
			, 0
			, pSALIDA
			, pUSUARIO
        );
	END LOOP;

	CLOSE curLinea;	
    
    commit;
END ;;
DELIMITER ;
