CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_INV_SALIDA_DETALLE`(
	  pSALIDA 		 int(11)
	, pLINEA 		 int(11)
	, pPRODUCTO 	 int(11)
	, pCODIGO 		 varchar(120)
	, pNOMBRE 		 varchar(150)
	, pUNIDAD_MEDIDA int(11)
	, pCANTIDAD 	 decimal(13,2)
	, pCOSTO 		 decimal(13,2)
	, pLOTE 		 varchar(20)
	, pVENCIMIENTO 	 datetime
	, pSERIE 		 varchar(50)
)
BEGIN
	DECLARE vCantidad INT;

	SELECT 	COUNT(*) INTO vCantidad
	FROM	tbl_inv_salida_detalle
	WHERE	ID_SALIDA = pSALIDA
		AND INT_LINEA = pLINEA;    

    IF vCantidad = 0 THEN
        INSERT INTO tbl_inv_salida_detalle
        (
			  ID_SALIDA
			, INT_LINEA
			, ID_PRODUCTO
			, TXT_CODIGO
			, TXT_NOMBRE
			, ID_UNIDAD_MEDIDA
			, DEC_CANTIDAD
			, DEC_COSTO
			, TXT_LOTE
			, FEC_VENCIMIENTO
			, TXT_SERIE
        )
        VALUES
        (
			  pSALIDA
			, pLINEA
			, pPRODUCTO
			, pCODIGO
			, pNOMBRE
			, pUNIDAD_MEDIDA
			, pCANTIDAD
			, pCOSTO
			, pLOTE
			, pVENCIMIENTO
			, pSERIE
        );
	ELSE
		UPDATE 	tbl_inv_salida_detalle
        SET		  ID_PRODUCTO = pPRODUCTO
				, TXT_CODIGO = pCODIGO
				, TXT_NOMBRE = pNOMBRE
				, ID_UNIDAD_MEDIDA = pUNIDAD_MEDIDA
				, DEC_CANTIDAD = pCANTIDAD
				, DEC_COSTO = pCOSTO
				, TXT_LOTE = pLOTE
				, FEC_VENCIMIENTO = pVENCIMIENTO
				, TXT_SERIE = pSERIE
        WHERE	ID_SALIDA = pSALIDA
			AND	INT_LINEA = pLINEA;
    END IF;
END ;;
DELIMITER ;
