CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_LOCAL`(
pCOD_LOCAL char(5),
pNOMBRE_LOCAL varchar(120),
pCOD_UBIGEO	char(6),
pID_DPTO int(11),
pTXT_DPTO_LOCAL	varchar(120),
pID_PROVI int(11),
pTXT_PROV_LOCAL	varchar(120),
-- pID_DISTRI	int(11)
pTXT_DISTR_LOCAL varchar(120),
pTXT_DIRECCION varchar(250),
pTXT_URB_LOCAL varchar(100),
pCOD_EMISOR	int(11),
pTELEF_FIJO1 varchar(11),
pTELEF_FIJO2 varchar(11)
)
BEGIN

		Update tbl_local set NOMBRE_LOCAL = pNOMBRE_LOCAL, COD_UBIGEO = pCOD_UBIGEO, 
        ID_DPTO = pID_DPTO, TXT_DPTO_LOCAL = pTXT_DPTO_LOCAL, ID_PROVI = pID_PROVI,
		TXT_PROV_LOCAL = pTXT_PROV_LOCAL,  TXT_DISTR_LOCAL = pTXT_DISTR_LOCAL, TXT_DIRECCION = pTXT_DIRECCION, 
        TXT_URB_LOCAL = pTXT_URB_LOCAL, COD_EMISOR = pCOD_EMISOR, TELEF_FIJO1 = pTELEF_FIJO1, TELEF_FIJO2 = pTELEF_FIJO2
        where COD_LOCAL = pCOD_LOCAL;

