CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_MOVIMIENTOS_INV_GUIA_ANULADA`(
	  pEMISOR INT(11)
    , pUSUARIO INT(11)
)
BEGIN
	DECLARE done INT DEFAULT FALSE;
	DECLARE pTXT_SERIE VARCHAR(4);
	DECLARE pTXT_CORRELATIVO VARCHAR(12);

	DECLARE dat CURSOR FOR 
    SELECT 	MOVI.TXT_SERIE, MOVI.TXT_CORRELATIVO
	FROM	tbl_guia_remision GUIA INNER JOIN tbl_inv_movimientos MOVI ON GUIA.ID_GUIA = MOVI.ID_DOCUMENTO AND MOVI.ID_TIPO_DOC = 5
	WHERE 	CHR_ESTADO = '02' AND GUIA.ID_EMISOR = pEMISOR
	GROUP BY MOVI.ID_EMISOR, MOVI.ID_PRODUCTO, MOVI.ID_TIPO_DOC, MOVI.TXT_SERIE, MOVI.TXT_CORRELATIVO
	HAVING COUNT(MOVI.ID_TIPO_MOV) = 1;
    
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	OPEN dat;

	read_loop: LOOP
		FETCH dat INTO pTXT_SERIE, pTXT_CORRELATIVO;

        
        INSERT INTO tbl_inv_movimientos
        SELECT 	  null
				, mov.ID_EMISOR
				, mov.ID_PRODUCTO
				, 5
				, mov.ID_TIPO_DOC
				, mov.TXT_SERIE
				, mov.TXT_CORRELATIVO
				, now()
				, mov.DEC_CANTIDAD
				, mov.DEC_COSTO
				, mov.DEC_TOTAL
				, mov.DEC_CANTIDAD + (SELECT IFNULL(sal.DEC_CANTIDAD_SALDO,0) FROM tbl_inv_movimientos sal WHERE sal.ID_PRODUCTO = mov.ID_PRODUCTO AND sal.BIT_ULTIMO = 1)
				, 0
				, mov.DEC_TOTAL + (SELECT IFNULL(sal.DEC_TOTAL_SALDO,0) FROM tbl_inv_movimientos sal WHERE sal.ID_PRODUCTO = mov.ID_PRODUCTO AND sal.BIT_ULTIMO = 1)
				, 1
				, mov.ID_DOCUMENTO
				, pUSUARIO
				, 0
				, 0
		FROM 	tbl_inv_movimientos mov
		WHERE 	TXT_SERIE = pTXT_SERIE AND TXT_CORRELATIVO = pTXT_CORRELATIVO AND ID_EMISOR = pEMISOR;
        
        
        UPDATE 	tbl_inv_movimientos movu
		SET 	movu.BIT_ULTIMO = 0
		WHERE 	movu.ID_PRODUCTO IN (SELECT mov.ID_PRODUCTO FROM (SELECT movi.ID_PRODUCTO FROM tbl_inv_movimientos movi WHERE movi.TXT_SERIE = pTXT_SERIE AND movi.TXT_CORRELATIVO = pTXT_CORRELATIVO AND movi.ID_EMISOR = pEMISOR) mov);

		UPDATE 	tbl_inv_movimientos
		SET 	  BIT_ULTIMO = 1
				, DEC_COSTO_SALDO = DEC_TOTAL_SALDO / DEC_CANTIDAD_SALDO
				, BIT_PROCESADO = 1
		WHERE 	TXT_SERIE = pTXT_SERIE AND TXT_CORRELATIVO = pTXT_CORRELATIVO AND ID_TIPO_MOV = 5 AND BIT_PROCESADO = 0 AND ID_EMISOR = pEMISOR;
			
                    IF done THEN
		  LEAVE read_loop;
		END IF;
            END LOOP;

	CLOSE dat;
END ;;
DELIMITER ;
