CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_PARAMETROS_CONFIG`( in prutaws varchar(100),
in prutaplantillas varchar(100), in prutaxmlfirmados varchar(100) , in prutatemporal varchar(100) ,
in ppasscertificado varchar(100), in pnombrecertificado varchar(100),
in pdiasemisioncpes varchar(100)
,in pdiasemisionenviobaja varchar(100), in  pdiasemisionresumen varchar(100) , in prutapdf varchar(100)
,in plogo varchar(100) ,
in pnumintentos varchar(100) ,in pflagmanual varchar(100),in pflagHomologacion varchar(100), in pemisor int(16))
BEGIN
  start transaction;
  update tbl_cliente_parametros set TXT_VALOR_PARAMETRO = case COD_PARAMETRO 
       when '001' then  prutaws
       when '012' then  prutaplantillas
       when '013' then  prutaxmlfirmados
       when '011' then  prutatemporal
       when '014' then  ppasscertificado
      when '015' then  pnombrecertificado
      when '017' then  pdiasemisioncpes
     when '016' then  pdiasemisionenviobaja
       when '006' then  pdiasemisionresumen
       when '018' then  prutapdf
       when '019' then  plogo
        when '020' then pnumintentos
         when '021' then  pflagmanual
          when '022' then  pflagHomologacion end 
where COD_PARAMETRO in ('001','012','013','011','014','015','017','016','006','018','019','020','021','022') and COD_EMISOR = pemisor ;

commit;
END ;;
