CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_PRODUCTO`(
	  pPRODUCTO 		int(11)
    , pCODIGO 			varchar(30)
	, pCODIGO_ALT 		varchar(30)
	, pCODIGO_SUNAT 	varchar(30)
	, pNOMBRE 			varchar(100)
	, pNOMBRE_ALT_1 	varchar(100)
	, pNOMBRE_ALT_2 	varchar(100)
	, pCLASE 			int(11)
	, pFAMILIA 			int(11)
	, pSEGMENTO 		int(11)
	, pUNIDAD_MED 		int(11)
	, pSTOCK_MIN 		decimal(13,2)
	, pESPECIFICACIONES varchar(120)
	, pPRECIO 			decimal(12,4)
    , pPRECIO_CON_IGV 	decimal(12,4)
	, pTIP_AFEC_IGV 	varchar(3)
	, pSERIE 			bit(1)
	, pFOTO 			varchar(40)
    , pESTADO 			char(1)
	, pUSUARIO 			bigint(20)
	, pEMISOR 			int(11)
    , pPESO				decimal(13,2)
    , pUNIDAD_PESO	    int(11)
    , pUNIDADES			varchar(8000)
    , pCANT_ENTERO		bit(1)
    , pINVENTARIO		bit(1)
)
BEGIN
	start transaction;
    
	UPDATE 	tbl_producto
	SET		  TXT_CODIGO 			= pCODIGO
			, TXT_CODIGO_ALT 		= pCODIGO_ALT
			, TXT_CODIGO_SUNAT		= pCODIGO_SUNAT
			, TXT_NOMBRE 			= pNOMBRE
			, TXT_NOMBRE_ALT_1 		= pNOMBRE_ALT_1
			, TXT_NOMBRE_ALT_2 		= pNOMBRE_ALT_2
			, ID_CLASE 				= pCLASE
			, ID_FAMILIA 			= pFAMILIA
			, ID_SEGMENTO 			= pSEGMENTO
			, ID_UNIDAD_MED 		= pUNIDAD_MED
			, DEC_STOCK_MIN 		= pSTOCK_MIN
			, TXT_ESPECIFICACIONES 	= pESPECIFICACIONES
			, DEC_PRECIO 			= pPRECIO
            , DEC_PRECIO_CON_IGV	= pPRECIO_CON_IGV
			, COD_TIP_AFEC_IGV 		= pTIP_AFEC_IGV
			, BIT_SERIE 			= pSERIE
			, TXT_FOTO 				= IF(pFOTO != '', CONCAT('PROD', LPAD(pPRODUCTO, 10, '0'), '.', SUBSTRING_INDEX(pFOTO,'.',-1)), '')
			, CHR_ESTADO 			= pESTADO
			, ID_USUARIO 			= pUSUARIO
			, FEC_ACTUALIZA 		= now()
            , DEC_PESO				= pPESO
            , ID_UNIDAD_PESO		= pUNIDAD_PESO
            , BIT_CANT_ENTERO		= pCANT_ENTERO
            , BIT_INVENTARIO		= pINVENTARIO
    WHERE 	ID_PRODUCTO = pPRODUCTO
		AND ID_EMISOR	= pEMISOR;
        
	CALL SP_INSERTAR_PRODUCTO_UNIDADES(pPRODUCTO, pUNIDADES);
        
	commit;
			
END ;;
DELIMITER ;
