CREATE DEFINER=`root`@`%` PROCEDURE `SP_ACTUALIZAR_STOCK`()
BEGIN
	DECLARE vCODIGO 	INT(11);
    DECLARE vCODIGO_ANT	INT(11);
	DECLARE vPRODUCTO 	INT(11);
    DECLARE vPRODUCTO_ANT 	INT(11);
    DECLARE vCANTIDAD  	DECIMAL(13,2);
    DECLARE vCOSTO  	DECIMAL(13,2);
    DECLARE vTOTAL  	DECIMAL(13,2);
    DECLARE vCANTIDADS 	DECIMAL(13,2);
    DECLARE vCOSTOS  	DECIMAL(13,2);
    DECLARE vTOTALS  	DECIMAL(13,2);
    DECLARE vENTSAL		BIT;
	DECLARE vDONE 		INT DEFAULT FALSE;
	DECLARE curLinea CURSOR FOR SELECT 	ID_MOVIMIENTO, ID_PRODUCTO, DEC_CANTIDAD, DEC_COSTO, DEC_TOTAL, BIT_ENTRADA
								FROM 	tbl_inv_movimientos
								WHERE ID_EMISOR = 3
								/*
                                AND  ID_PRODUCTO IN (
								SELECT 	P.ID_PRODUCTO
								FROM	tbl_producto P INNER JOIN  tbl_inv_movimientos M ON P.ID_PRODUCTO = M.ID_PRODUCTO 
																						AND M.BIT_ULTIMO = 1
																						AND P.ID_EMISOR = 3
																						AND M.ID_EMISOR = 3
								WHERE P.DEC_STOCK <> M.DEC_CANTIDAD_SALDO) AND ID_PRODUCTO = 358*/
								ORDER BY ID_PRODUCTO, ID_MOVIMIENTO;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET vDONE = TRUE;
    
        INSERT INTO tbl_inv_movimientos
	SELECT 	
	  NULL
	, D.ID_EMISOR
	, D.ID_PRODUCTO
	, D.ID_TIP_MOV
	, D.ID_TIPO_DOC
	, D.TXT_SERIE
	, D.TXT_CORRELATIVO
	, NOW()
	, D.DEC_CANTIDAD
	, D.DEC_COSTO_UNI
	, D.DEC_COSTO_UNI * D.DEC_CANTIDAD
	, 0
	, 0
	, 0
	, 1
	, D.ID_ENTRADA
	, D.ID_USUARIO
	, 0
	, 1
	FROM	(	SELECT 	D.ID_ENTRADA, G.ID_USUARIO, D.DEC_CANTIDAD, G.ID_EMISOR, G.TXT_CORRELATIVO, G.TXT_SERIE, D.ID_PRODUCTO, D.DEC_COSTO_UNI, G.ID_TIP_MOV, G.ID_TIPO_DOC
				FROM 	tbl_inv_entrada_detalle D INNER JOIN tbl_inv_entrada G 	 ON D.ID_ENTRADA = G.ID_ENTRADA
																				AND G.ID_EMISOR = 3 
																				-- AND G.CHR_ESTADO = '01'
																				-- AND G.ID_MOTIVO = 8
													LEFT JOIN tbl_inv_movimientos M ON D.ID_ENTRADA = M.ID_DOCUMENTO 
																					AND D.ID_PRODUCTO = M.ID_PRODUCTO
																					AND G.ID_EMISOR = M.ID_EMISOR
																					AND M.BIT_ENTRADA = 1
																					AND M.BIT_PROCESADO = 1
				WHERE M.ID_DOCUMENTO IS NULL ) D 

	WHERE  D.ID_EMISOR = 3
    AND D.ID_TIPO_DOC <> 5;
    
    INSERT INTO tbl_inv_movimientos
	SELECT 	
	  NULL
	, D.ID_EMISOR
	, D.ID_PRODUCTO
	, IF( D.ID_MOTIVO = 8, 7, IF( D.ID_MOTIVO = 4, 4, 1))
	, 5
	, D.TXT_SERIE
	, D.TXT_CORRELATIVO
	, NOW()
	, D.DEC_CANTIDAD
	, U.DEC_COSTO_SALDO
	, U.DEC_COSTO_SALDO * D.DEC_CANTIDAD
	, 0
	, 0
	, 0
	, 0
	, D.ID_GUIA
	, D.ID_USUARIO
	, 0
	, 1
	FROM	(	SELECT 	D.ID_GUIA, G.ID_USUARIO, D.DEC_CANTIDAD, G.ID_EMISOR, G.TXT_CORRELATIVO, G.TXT_SERIE, D.ID_PRODUCTO, G.ID_MOTIVO
				FROM 	tbl_guia_remision_detalle D INNER JOIN tbl_guia_remision G 	 ON D.ID_GUIA = G.ID_GUIA 
																					AND G.ID_EMISOR = 3 
																					AND G.CHR_ESTADO = '01'
																				-- AND G.ID_MOTIVO = 8
													LEFT JOIN tbl_inv_movimientos M ON D.ID_GUIA = M.ID_DOCUMENTO 
																					AND D.ID_PRODUCTO = M.ID_PRODUCTO
																					AND G.ID_EMISOR = M.ID_EMISOR
																					AND M.BIT_ENTRADA = 0
																					AND M.BIT_PROCESADO = 1
				WHERE M.ID_DOCUMENTO IS NULL ) D 
			INNER JOIN ( 	SELECT  ID_PRODUCTO, IFNULL(DEC_COSTO_SALDO,0) AS DEC_COSTO_SALDO, ID_EMISOR
							FROM	tbl_inv_movimientos
							WHERE 	ID_EMISOR = 3
								AND BIT_ULTIMO = 1 ) U ON D.ID_PRODUCTO = U.ID_PRODUCTO
														AND D.ID_EMISOR = U.ID_EMISOR
	WHERE  D.ID_EMISOR = 3;
    
    INSERT INTO tbl_inv_movimientos
	SELECT 	
	  NULL
	, M.ID_EMISOR
	, M.ID_PRODUCTO
	, 5
	, M.ID_TIPO_DOC
	, M.TXT_SERIE
	, M.TXT_CORRELATIVO
	, NOW()
	, M.DEC_CANTIDAD
	, M.DEC_COSTO
	, M.DEC_TOTAL
	, M.DEC_CANTIDAD_SALDO
	, M.DEC_COSTO_SALDO
	, M.DEC_TOTAL_SALDO
	, 1
	, M.ID_DOCUMENTO
	, M.ID_USUARIO
	, M.BIT_ULTIMO
	, M.BIT_PROCESADO
	FROM	tbl_inv_movimientos M INNER JOIN (	SELECT 	G.ID_GUIA, D.ID_PRODUCTO
												FROM 	tbl_guia_remision_detalle D INNER JOIN tbl_guia_remision G 	 ON D.ID_GUIA = G.ID_GUIA 
																													AND G.ID_EMISOR = 3 
																													AND G.CHR_ESTADO = '02'
																					LEFT JOIN tbl_inv_movimientos M ON D.ID_GUIA = M.ID_DOCUMENTO 
																													AND D.ID_PRODUCTO = M.ID_PRODUCTO
																													AND G.ID_EMISOR = M.ID_EMISOR
																													AND M.ID_TIPO_MOV = 5
																													AND M.BIT_PROCESADO = 1
												WHERE M.ID_DOCUMENTO IS NULL) D ON M.ID_DOCUMENTO = D.ID_GUIA 
																				AND M.ID_PRODUCTO = D.ID_PRODUCTO
	WHERE  ID_EMISOR = 3;
    
    INSERT INTO tbl_inv_movimientos
	SELECT 	
	  NULL
	, M.ID_EMISOR
	, M.ID_PRODUCTO
	, 6
	, M.ID_TIPO_DOC
	, M.TXT_SERIE
	, M.TXT_CORRELATIVO
	, NOW()
	, M.DEC_CANTIDAD
	, M.DEC_COSTO
	, M.DEC_TOTAL
	, M.DEC_CANTIDAD_SALDO
	, M.DEC_COSTO_SALDO
	, M.DEC_TOTAL_SALDO
	, 0
	, M.ID_DOCUMENTO
	, M.ID_USUARIO
	, M.BIT_ULTIMO
	, M.BIT_PROCESADO
	FROM	tbl_inv_movimientos M INNER JOIN (	SELECT 	G.ID_GUIA, D.ID_PRODUCTO
												FROM 	tbl_guia_remision_detalle D INNER JOIN tbl_guia_remision G 	 ON D.ID_GUIA = G.ID_GUIA 
																													AND G.ID_EMISOR = 3 
																													AND G.CHR_ESTADO = '02'
																													AND G.ID_MOTIVO = 8
																					INNER JOIN tbl_inv_movimientos M ON D.ID_GUIA = M.ID_DOCUMENTO 
																													AND D.ID_PRODUCTO = M.ID_PRODUCTO
																													AND G.ID_EMISOR = M.ID_EMISOR
																													AND M.ID_TIPO_MOV = 6
																													AND M.BIT_PROCESADO = 1
												WHERE M.ID_DOCUMENTO IS NULL ) D ON M.ID_DOCUMENTO = D.ID_GUIA 
																				AND M.ID_PRODUCTO = D.ID_PRODUCTO
	WHERE  ID_EMISOR = 3;
    
    OPEN curLinea;
	
    SET vPRODUCTO_ANT = 0;
    SET vCANTIDAD = 0;
    SET vCOSTO = 0;
    SET vTOTAL = 0;
    SET vCANTIDADS = 0;
    SET vCOSTOS = 0;
    SET vTOTALS = 0;
    SET vCODIGO_ANT = -1;
	vLOOP: LOOP
		SET vDONE = FALSE;
		FETCH curLinea INTO vCODIGO, vPRODUCTO, vCANTIDAD, vCOSTO, vTOTAL, vENTSAL;
		IF vDONE THEN
		  LEAVE vLOOP;
		END IF;	
		
        IF (vPRODUCTO <> vPRODUCTO_ANT) THEN
			SET vPRODUCTO_ANT = vPRODUCTO;
			SET vCANTIDADS = vCANTIDAD;
			SET vTOTALS = vTOTAL;
            
            UPDATE 	tbl_inv_movimientos
            SET 	BIT_ULTIMO = 1
            WHERE	ID_MOVIMIENTO = vCODIGO_ANT
				AND ID_EMISOR = 3;
                
			SET vCODIGO_ANT = vCODIGO;
		ELSE
			IF (vENTSAL = 1) THEN
				SET vCANTIDADS = vCANTIDADS + vCANTIDAD;
				SET vTOTALS = vTOTALS + vTOTAL;
            ELSE
				SET vCANTIDADS = vCANTIDADS - vCANTIDAD;
				SET vTOTALS = vTOTALS - vTOTAL;
            END IF;
            IF (vCANTIDADS = 0) THEN
				SET vCOSTOS = 0;
			ELSE
				SET vCOSTOS = vTOTALS / vCANTIDADS;
			END IF;
        END IF;
        
		UPDATE 	tbl_inv_movimientos
        SET		  DEC_CANTIDAD_SALDO = vCANTIDADS
				, DEC_COSTO_SALDO = IFNULL(vCOSTOS, 0)
				, DEC_TOTAL_SALDO = IFNULL(vTOTALS, 0)
                , BIT_ULTIMO = 0
		WHERE	ID_MOVIMIENTO = vCODIGO
			AND ID_EMISOR = 3;
	END LOOP;

	UPDATE 	tbl_inv_movimientos
	SET 	BIT_ULTIMO = 1
	WHERE	ID_MOVIMIENTO = vCODIGO_ANT
		AND ID_EMISOR = 3;
        
    UPDATE 	tbl_inv_movimientos
	SET 	BIT_ULTIMO = 0
	WHERE 	ID_EMISOR = 3;

	UPDATE tbl_inv_movimientos M INNER JOIN  (
	SELECT 	MAX(ID_MOVIMIENTO) AS ID_MOVIMIENTO
	FROM 	tbl_inv_movimientos
	WHERE 	ID_EMISOR = 3
	GROUP BY ID_PRODUCTO )  U ON M.ID_MOVIMIENTO = U.ID_MOVIMIENTO AND M.ID_EMISOR = 3
	SET M.BIT_ULTIMO = 1;
                
	CLOSE curLinea;
END ;;
DELIMITER ;
