CREATE DEFINER=`root`@`%` PROCEDURE `SP_ANULAR_GUIA_REMISION`(
	  pGUIA 					int(11)
	, pMOTIVO_ANULACION 		varchar(300)
	, pUSUARIO 					bigint(20)
	, pEMISOR 					int(11)
)
BEGIN
	DECLARE pFEC_EMIS datetime;
	DECLARE resultado int;
	DECLARE mensaje varchar(100);
	DECLARE vSERIE 		VARCHAR(4) DEFAULT 'GU00';
	DECLARE vCODIGO 	varchar(12) DEFAULT 0;
	DECLARE vSERIE_REF 	VARCHAR(4) DEFAULT '';
	DECLARE vCODIGO_REF varchar(12) DEFAULT '';
    DECLARE vCOD_AQU 	int(11) DEFAULT 0;
    DECLARE vRUC_AQU 	VARCHAR(20) DEFAULT '';
    DECLARE vNOM_AQU 	VARCHAR(120) DEFAULT '';
    DECLARE vDIR_AQU 	VARCHAR(500) DEFAULT '';
    DECLARE vNUM_ITE	int(11) default 0;
    DECLARE vNUM_CPE	int(11) default 0;
    DECLARE vTIP_AQU 	CHAR(1) DEFAULT '0';
    DECLARE vCOD_LOCAL 	CHAR(5) DEFAULT '';
	DECLARE vULT_CODIGO INT(11) DEFAULT 0;
    DECLARE pMOTIVO 	INT(11);
	DECLARE vDONE 		INT DEFAULT FALSE;
	DECLARE vPRODUCTO 	INT(11);
    DECLARE vCANTIDAD  	DECIMAL(13,2);
	DECLARE curLinea CURSOR FOR SELECT     Deta.ID_PRODUCTO
										 , (Deta.DEC_CANTIDAD / IFNULL(PrUn.DEC_FACTOR, 1)) AS DEC_CANTIDAD
								FROM 	 tbl_guia_remision_detalle Deta LEFT OUTER JOIN tbl_producto_unidades PrUn ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO AND Deta.ID_UNIDAD = PrUn.ID_UNIDAD
								WHERE 	 Deta.ID_GUIA = pGUIA
								ORDER BY Deta.ID_PRODUCTO, INT_LINEA;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET vDONE = TRUE;
	
    start transaction;
    
    SELECT  TXT_SERIE, TXT_CORRELATIVO, ID_MOTIVO, TXT_RES_SERIE, TXT_RES_CORRELATIVO, ID_DESTINATARIO, COD_LOCAL INTO vSERIE, vCODIGO, pMOTIVO, vSERIE_REF, vCODIGO_REF, vCOD_AQU, vCOD_LOCAL
    FROM 	tbl_guia_remision
    WHERE 	ID_GUIA = pGUIA
		AND ID_EMISOR = pEMISOR
        AND BIT_NUEVO = 0
	LIMIT 1;
    
    if (NOT vSERIE_REF IS NULL) then
		SELECT 	MAX(CAST(TXT_CORRELATIVO AS SIGNED)) INTO vULT_CODIGO
		FROM 	tbl_cpe_cabecera 
		WHERE 	COD_CLIENTE_EMIS = pEMISOR
			AND TXT_SERIE = vSERIE_REF
            AND COD_ESTADO_DOC = '06';
            
		if (vULT_CODIGO = CAST(vCODIGO_REF AS SIGNED)) then
			DELETE FROM tbl_cpe_cabecera
            WHERE 	COD_CLIENTE_EMIS = pEMISOR
				AND TXT_SERIE = vSERIE_REF
                AND TXT_CORRELATIVO = vCODIGO_REF;
		else
			SELECT 	NUM_CPE, FEC_EMIS INTO vNUM_CPE, pFEC_EMIS
            FROM 	tbl_cpe_cabecera
            WHERE 	COD_CLIENTE_EMIS = pEMISOR
				AND TXT_SERIE = vSERIE_REF
                AND TXT_CORRELATIVO = vCODIGO_REF
                AND COD_ESTADO_DOC = '06';
                
			if (NOT vNUM_CPE = 0) then
				SELECT 	NUM_IDEN_RECP, NOM_RZN_SOC_RECP, TXT_DMCL_FISC_RECEP, COD_TIP_NIF_RECP INTO vRUC_AQU, vNOM_AQU, vDIR_AQU, vTIP_AQU
				FROM 	tbl_adquiriente
				WHERE 	ID_ADQ = vCOD_AQU;
				
				SELECT 	COUNT(*) INTO vNUM_ITE
				FROM 	tbl_guia_remision_detalle
				WHERE 	ID_GUIA = pGUIA;
			
				UPDATE 	tbl_cpe_cabecera INNER JOIN tbl_emisor emi ON emi.NUM_COD_EMISOR = tbl_cpe_cabecera.COD_CLIENTE_EMIS AND emi.NUM_COD_EMISOR = pEMISOR
				SET 	  COD_MND = 'PEN'
						, COD_ESTADO_DOC = '02'
						, COD_ESTADO_SUNAT = '101'
						, tbl_cpe_cabecera.NUM_RUC_EMIS = emi.NUM_RUC_EMIS
