							, Deta.TXT_LOTE
							, Deta.FEC_VENCIMIENTO
							, SUM(Deta.DEC_CANTIDAD) AS DEC_CANTIDAD
					FROM 	tbl_guia_remision Guia INNER JOIN tbl_guia_remision_detalle Deta ON Guia.ID_GUIA = Deta.ID_GUIA
