CREATE DEFINER=`root`@`%` PROCEDURE `SP_ANULAR_INV_FACTURA`(
	  pTXT_SERIE CHAR(4)
	, pTXT_CORRELATIVO VARCHAR(12)
    , pCLIENTE int(11)
    , pUSUARIO bigint(20)
)
BEGIN
	DECLARE vExiste INT;
    
    SELECT 	count(*) INTO vExiste
	FROM 	tbl_inv_movimientos
	WHERE 	TXT_SERIE = pTXT_SERIE 
		AND TXT_CORRELATIVO = pTXT_CORRELATIVO
        AND ID_EMISOR = pCLIENTE;
        
	IF vExiste > 0 THEN
		SELECT 	count(*) INTO vExiste
		FROM 	tbl_inv_movimientos
		WHERE 	TXT_SERIE = pTXT_SERIE 
			AND TXT_CORRELATIVO = pTXT_CORRELATIVO 
            AND ID_EMISOR = pCLIENTE
			AND ID_TIPO_MOV = 5;
            
		IF vExiste = 0 THEN
			INSERT INTO tbl_inv_movimientos
			SELECT 	  null
					, mov.ID_EMISOR
					, mov.ID_PRODUCTO
					, 5
					, mov.ID_TIPO_DOC
					, mov.TXT_SERIE
					, mov.TXT_CORRELATIVO
					, now()
					, mov.DEC_CANTIDAD
					, mov.DEC_COSTO
					, mov.DEC_TOTAL
					, mov.DEC_CANTIDAD + (SELECT IFNULL(sal.DEC_CANTIDAD_SALDO,0) FROM tbl_inv_movimientos sal WHERE sal.ID_PRODUCTO = mov.ID_PRODUCTO AND sal.BIT_ULTIMO = 1)
					, 0
					, mov.DEC_TOTAL + (SELECT IFNULL(sal.DEC_TOTAL_SALDO,0) FROM tbl_inv_movimientos sal WHERE sal.ID_PRODUCTO = mov.ID_PRODUCTO AND sal.BIT_ULTIMO = 1)
					, 1
					, mov.ID_DOCUMENTO
					, pUSUARIO
					, 0
					, 0
			FROM 	tbl_inv_movimientos mov
			WHERE 	TXT_SERIE = pTXT_SERIE AND TXT_CORRELATIVO = pTXT_CORRELATIVO AND ID_EMISOR = pCLIENTE;
            
            UPDATE 	tbl_inv_movimientos movu
            SET 	movu.BIT_ULTIMO = 0
            WHERE 	movu.ID_PRODUCTO IN (SELECT mov.ID_PRODUCTO FROM (SELECT movi.ID_PRODUCTO FROM tbl_inv_movimientos movi WHERE movi.TXT_SERIE = pTXT_SERIE AND movi.TXT_CORRELATIVO = pTXT_CORRELATIVO AND movi.ID_EMISOR = pCLIENTE) mov);
            
            UPDATE 	tbl_inv_movimientos
            SET 	  BIT_ULTIMO = 1
					, DEC_COSTO_SALDO = DEC_TOTAL_SALDO / DEC_CANTIDAD_SALDO
                    , BIT_PROCESADO = 1
            WHERE 	TXT_SERIE = pTXT_SERIE AND TXT_CORRELATIVO = pTXT_CORRELATIVO AND ID_TIPO_MOV = 5 AND BIT_PROCESADO = 0 AND ID_EMISOR = pCLIENTE;
            
            UPDATE 	tbl_producto prod INNER JOIN tbl_inv_movimientos movi ON prod.ID_PRODUCTO = movi.ID_PRODUCTO AND movi.TXT_SERIE = pTXT_SERIE AND movi.TXT_CORRELATIVO = pTXT_CORRELATIVO AND movi.ID_TIPO_MOV = 5 AND prod.ID_EMISOR = pCLIENTE
            SET 	prod.DEC_STOCK = prod.DEC_STOCK + movi.DEC_CANTIDAD;     
            
			UPDATE 	tbl_inventario Inve
			JOIN  	(	SELECT    Deta.ID_UBICACION
								, Guia.COD_CLIENTE_EMIS AS ID_EMISOR
								, Deta.ID_PRODUCTO
								, Deta.TXT_LOTE
								, Deta.FEC_VENCIMIENTO
								, SUM((Deta.CANT_UNID_ITEM / IFNULL(PrUn.DEC_FACTOR, 1))) AS DEC_CANTIDAD
						FROM 	tbl_cpe_cabecera Guia  INNER JOIN tbl_cpe_det_cabecera Deta ON 	Guia.NUM_CPE = Deta.NUM_CPE
																							AND Guia.COD_TIP_CPE IN ('01','03')
																							AND Guia.COD_IDEN_CB = ''
																							AND Guia.TXT_SERIE = pTXT_SERIE 
																							AND Guia.TXT_CORRELATIVO = pTXT_CORRELATIVO
																							AND Guia.COD_CLIENTE_EMIS = pCLIENTE
												INNER JOIN tbl_unidad_medida unid			ON  Deta.COD_UNID_ITEM = unid.TXT_COD_UND
												LEFT OUTER JOIN tbl_producto_unidades PrUn 	ON Deta.ID_PRODUCTO = PrUn.ID_PRODUCTO
																						   AND unid.ID_UNIDAD = PrUn.ID_UNIDAD
						GROUP BY  Guia.COD_CLIENTE_EMIS
								, Deta.ID_UBICACION
								, Deta.ID_PRODUCTO
								, Deta.TXT_LOTE
								, Deta.FEC_VENCIMIENTO ) GRDe  ON   GRDe.ID_PRODUCTO = Inve.ID_PRODUCTO
																AND GRDe.ID_UBICACION = Inve.ID_UBICACION
																AND GRDe.TXT_LOTE = Inve.TXT_LOTE
																AND IFNULL(GRDe.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01'))
																AND GRDe.ID_EMISOR = Inve.ID_EMISOR
			SET  	Inve.NUM_CANTIDAD = Inve.NUM_CANTIDAD + GRDe.DEC_CANTIDAD
			WHERE	Inve.ID_EMISOR = pCLIENTE;
        END IF;
	ELSE
		UPDATE 	tbl_guia_remision_detalle DEGR INNER JOIN (
		SELECT    Deta.ID_UBICACION
				, Guia.COD_CLIENTE_EMIS AS ID_EMISOR
				, Deta.ID_PRODUCTO
				, Deta.TXT_LOTE
				, Deta.FEC_VENCIMIENTO
				, Deta.CANT_UNID_ITEM
				, RELA.ID_GUIA
		FROM 	tbl_cpe_det_cabecera Deta  INNER JOIN tbl_cpe_cabecera Guia ON 	Guia.NUM_CPE = Deta.NUM_CPE
																			AND Guia.COD_TIP_CPE IN ('01','03')
																			AND Guia.COD_IDEN_CB = ''
																			AND Guia.TXT_SERIE = pTXT_SERIE
																			AND Guia.TXT_CORRELATIVO = pTXT_CORRELATIVO
																			AND Guia.COD_CLIENTE_EMIS = pCLIENTE
										   INNER JOIN tbl_relacion_factura_guia RELA ON Guia.NUM_CPE = RELA.NUM_CPE AND RELA.ID_PROCESO = 1
		) REGF ON 	DEGR.ID_GUIA = REGF.ID_GUIA
				AND DEGR.ID_PRODUCTO = REGF.ID_PRODUCTO
				AND DEGR.ID_UBICACION = REGF.ID_UBICACION
				AND DEGR.TXT_LOTE = REGF.TXT_LOTE
				AND IFNULL(DEGR.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(REGF.FEC_VENCIMIENTO, DATE('1000-01-01'))
		SET DEGR.DEC_CANTIDAD_FAC = DEGR.DEC_CANTIDAD_FAC - REGF.CANT_UNID_ITEM;
		
		UPDATE 	tbl_guia_remision REMI INNER JOIN (
		SELECT  RELA.ID_GUIA
		FROM 	tbl_cpe_cabecera Guia INNER JOIN tbl_relacion_factura_guia RELA ON 
																				Guia.COD_TIP_CPE IN ('01','03')
																			AND Guia.COD_IDEN_CB = ''
																			AND Guia.TXT_SERIE = pTXT_SERIE
																			AND Guia.TXT_CORRELATIVO = pTXT_CORRELATIVO
																			AND Guia.COD_CLIENTE_EMIS = pCLIENTE
																			AND Guia.NUM_CPE = RELA.NUM_CPE AND RELA.ID_PROCESO = 1
		) REGF ON 	REMI.ID_GUIA = REGF.ID_GUIA
		SET REMI.BIT_FACTURADO = 0;    
	END IF;
END ;;
DELIMITER ;
