CREATE DEFINER=`root`@`%` PROCEDURE `SP_ANULAR_INV_MOVIMIENTO`(
	  pEMISOR int(11)
	, pPRODUCTO int(11)
	, pTIPO_MOV int(11)
	, pTIPO_DOC int(11)
	, pSERIE varchar(4)
	, pCORRELATIVO varchar(10)
	, pCANTIDAD decimal(13,2)
	, pENTRADA bit(1)
	, pDOCUMENTO int(11)
    , pDOCUMENTO_ORI int(11)
    , pTIPO_DOC_ORI int(11)
	, pUSUARIO bigint(20)
)
BEGIN
	DECLARE vID_MOVIMIENTO INT;
    DECLARE vCOSTO DECIMAL(13,2);
	DECLARE vCANTIDAD_SALDO DECIMAL(13,2);
    DECLARE vCOSTO_SALDO DECIMAL(13,2);
    DECLARE vTOTAL_SALDO DECIMAL(13,2);
    
    SET vID_MOVIMIENTO = 0;
    SET vCOSTO = 0;
    SET vCANTIDAD_SALDO = 0;
    SET vCOSTO_SALDO = 0;
    SET vTOTAL_SALDO = 0;
    
    SELECT  ID_MOVIMIENTO, DEC_CANTIDAD_SALDO, DEC_COSTO_SALDO, DEC_TOTAL_SALDO INTO vID_MOVIMIENTO, vCANTIDAD_SALDO, vCOSTO_SALDO, vTOTAL_SALDO
    FROM 	tbl_inv_movimientos
    WHERE 	ID_PRODUCTO = pPRODUCTO
		AND ID_EMISOR = pEMISOR
        AND BIT_ULTIMO = 1
        AND BIT_PROCESADO = 1
	LIMIT 1;
	
	SELECT  DEC_COSTO INTO vCOSTO
    FROM 	tbl_inv_movimientos
    WHERE 	ID_PRODUCTO = pPRODUCTO
		AND ID_EMISOR = pEMISOR
        AND ID_TIPO_DOC = pTIPO_DOC_ORI
        AND ID_DOCUMENTO = pDOCUMENTO_ORI
	LIMIT 1;   
    
    IF (vCOSTO >= 0 AND vID_MOVIMIENTO > 0) THEN
		UPDATE  tbl_inv_movimientos
		SET 	BIT_ULTIMO = 0
		WHERE 	ID_PRODUCTO = pPRODUCTO
			AND ID_EMISOR = pEMISOR
            AND BIT_ULTIMO = 1;
            
		INSERT INTO tbl_inv_movimientos
		(
			  ID_EMISOR
			, ID_PRODUCTO
			, ID_TIPO_MOV
			, ID_TIPO_DOC
			, TXT_SERIE
			, TXT_CORRELATIVO
			, FEC_REGISTRO
			, DEC_CANTIDAD
			, DEC_COSTO
			, DEC_TOTAL
			, DEC_CANTIDAD_SALDO
			, DEC_COSTO_SALDO
			, DEC_TOTAL_SALDO
			, BIT_ENTRADA
			, ID_DOCUMENTO
			, ID_USUARIO
			, BIT_ULTIMO
			, BIT_PROCESADO
		)
		VALUES
		(
			  pEMISOR
			, pPRODUCTO
			, pTIPO_MOV
			, pTIPO_DOC
			, pSERIE
			, pCORRELATIVO
			, now()
			, pCANTIDAD
			, vCOSTO
			, (pCANTIDAD * vCOSTO)
			, IF( vID_MOVIMIENTO = 0, pCANTIDAD, IF(pENTRADA = 1, pCANTIDAD + vCANTIDAD_SALDO, vCANTIDAD_SALDO - pCANTIDAD))
			, IF( vID_MOVIMIENTO = 0, vCOSTO, IF(pENTRADA = 1, ((pCANTIDAD * vCOSTO) + vTOTAL_SALDO) / (pCANTIDAD + vCANTIDAD_SALDO), (vTOTAL_SALDO - (pCANTIDAD * vCOSTO)) / (vCANTIDAD_SALDO - pCANTIDAD)))
			, IF( vID_MOVIMIENTO = 0, (pCANTIDAD * vCOSTO), IF(pENTRADA = 1, (pCANTIDAD * vCOSTO) + vTOTAL_SALDO, vTOTAL_SALDO - (pCANTIDAD * vCOSTO)))
			, pENTRADA
			, pDOCUMENTO
			, pUSUARIO
			, 1
			, 1
		);
	END IF;
END ;;
DELIMITER ;
