CREATE DEFINER=`root`@`%` PROCEDURE `SP_CARGAR_DATOS_CABECERA_GUIA_REMISION`(
in pcodCliente int(11)
)
BEGIN

	declare vNumRucRem varchar(11) default null;
    declare vNomRznSocRem varchar(100) default null;
    declare vCodTipNifRem char(1) default null;
    
	/*
	* Se obtienen los datos del cliente itc, ya que en la tabla de g.r no se consignan
	**/
        
    select NUM_RUC_EMIS, NOM_RZN_SOC_EMIS, COD_TIP_NIF_EMIS into vNumRucRem, vNomRznSocRem, vCodTipNifRem from tbl_emisor where NUM_COD_EMISOR = pcodCliente;

	SELECT 
		gr.ID_GUIA,
		gr.TXT_SERIE,
		gr.TXT_CORRELATIVO,
        
        vNumRucRem as NUM_RUC_REM,
        vNomRznSocRem as NOM_RZN_SOC_REM,
        vCodTipNifRem as COD_TIP_NIF_REM,
        
		-- gr.ID_DESTINATARIO,
        IF (gr.ID_MOTIVO = '8', vCodTipNifRem, adq.COD_TIP_NIF_RECP) as COD_TIP_NIF_DEST, -- adq.COD_TIP_NIF_RECP as COD_TIP_NIF_DEST,
		IF (gr.ID_MOTIVO = '8', vNumRucRem, adq.NUM_IDEN_RECP) as NUM_RUC_DEST, -- adq.NUM_IDEN_RECP as NUM_RUC_DEST,
        IF (gr.ID_MOTIVO = '8', vNomRznSocRem, adq.NOM_RZN_SOC_RECP) as NOM_RZN_SOC_DEST, -- adq.NOM_RZN_SOC_RECP as NOM_RZN_SOC_DEST,
		
		date(gr.FEC_EMISION) as FEC_EMISION,
		date(gr.FEC_TRASLADO) as FEC_TRASLADO,
		gr.TXT_DOMICILIO_PARTIDA,
		gr.TXT_DOMICILIO_LLEGADA,
		gr.ID_MOTIVO,
		gr.TXT_NOMBRE_TRANS,
		gr.TXT_RUC_TRANS,
		gr.TXT_VEHICULO,
		gr.TXT_PLACA,
		gr.TXT_LICENCIA,
		gr.TXT_CERTIFICADO_INS,
		gr.TXT_ORDEN_COMPRA,
		gr.TXT_FACTURA,
		gr.ID_FACTURA,
		gr.TXT_OBSERVACION,
		gr.ID_USUARIO,
		gr.ID_EMISOR,
		gr.BIT_NUEVO,
		gr.ID_ALMACEN_PART,
		gr.ID_ALMACEN_LLEG,
		gr.TXT_RES_SERIE,
		gr.TXT_RES_CORRELATIVO,
		gr.CHR_ESTADO,
		gr.COD_LOCAL,
		gr.TXT_MOTIVO_ANULACION,
		gr.ID_USUARIO_ANULACION,
		gr.FEC_FECHA_ANULACION,
		gr.BIT_FACTURADO,
		gr.TIP_DOC,
		gr.FLAG_CARGA,
        
	/*
	* Datos en duro
	**/
	
	'09' as COD_TIP_CPE,
	
	time(FEC_EMISION) as HORA_EMIS,
	
	'150101' as COD_UBI_PARTIDA, --
	'150101' as COD_UBI_LLEGADA, --
    
	null as TRANS_NUM_CONTENEDOR, --
	
	'TRASLADO' as TXT_DESC_MOTIV_TRAS, -- aa
	'02' as TRANS_COD_TIP_MODALIDAD, -- aa
	
	gr.TRANS_CONDUCT_COD_TIP_NIF as TRANS_CONDUCT_COD_TIP_NIF,
	gr.TRANS_CONDUCT_NUM_IDEN as TRANS_CONDUCT_NUM_IDEN, 
	
	gr.TXT_NOMBRE_TRANS as TRANS_TXT_NOMBRE,
	gr.TXT_RUC_TRANS as TRANS_TXT_RUC,
	gr.TRANS_COD_TIP_NIF as TRANS_COD_TIP_NIF,
    
	gr.NUM_RUC_PROV as NUM_RUC_PROV,
	gr.NOM_RZN_SOC_PROV as NOM_RZN_SOC_PROV,
	gr.COD_TIP_NIF_PROV as COD_TIP_NIF_PROV,
	
	'0' as CANT_BULTOS_EXPOR, --
	'KGM' as COD_UNID_PESO_BRUTO, --
	'0.000' as MNT_TOT_PESO_BRUTO, --
	
	gr.TXT_ORDEN_COMPRA as DATO_EXTRA_1,
	gr.TXT_FACTURA as DATO_EXTRA_2,
	null as DATO_EXTRA_3,
	null as DATO_EXTRA_4
	
	from tbl_guia_remision gr
	inner join tbl_adquiriente adq
		on adq.ID_ADQ = gr.ID_DESTINATARIO
	where 
		ID_EMISOR = pcodCliente
		and FLAG_CARGA = '0'
		and TIP_DOC = 'E'
	LIMIT 300;

END ;;
DELIMITER ;
