CREATE DEFINER=`root`@`%` PROCEDURE `SP_CARGAR_DATOS_DETALLE_GUIA_REMISION`(
in pNUM_CPE int
)
BEGIN

	SELECT 
		ID_GUIA,
		INT_LINEA,
		ID_PRODUCTO,
		TXT_CODIGO_PROD,
		TXT_NOMBRE_PROD,
		ID_UNIDAD,
		DEC_CANTIDAD,
		DEC_PESO,
		TXT_OBSERVACION,
		TXT_LOTE,
		FEC_VENCIMIENTO,
		ID_UBICACION,
		TXT_SERIE,
		ID_UNIDAD_PESO,
		ID_UBICACION_DEST,
		DEC_CANTIDAD_FAC,
		ID_CPE_DETALLE,
        
        /*
        * Datos en duro
        **/
        
		'00000000' as COD_PROD_SUNAT,
		'NIU' as COD_UNID_ITEM,

        null as DATO_EXTRA_1,
        null as DATO_EXTRA_2,
        null as DATO_EXTRA_3,
        null as DATO_EXTRA_4
        
	FROM 
		tbl_guia_remision_detalle
	WHERE
		ID_GUIA = pNUM_CPE;
        
END ;;
