CREATE DEFINER=`root`@`%` PROCEDURE `SP_COMBO_DISTRITO_BY_PRO`(pCOD_PROVINCIA INT)
BEGIN
	DECLARE vTXT_DEPARTAMENTO VARCHAR(2);
    DECLARE vTXT_PROVINCIA VARCHAR(2);
    
    SELECT  TXT_DEPARTAMENTO, TXT_PROVINCIA INTO vTXT_DEPARTAMENTO, vTXT_PROVINCIA
    FROM	tbl_ubigeo
    WHERE 	ID_UBIGEO = pCOD_PROVINCIA;
    
	SELECT	  ID_UBIGEO AS Codigo
			, TXT_NOMBRE AS Nombre
    FROM 	tbl_ubigeo
    WHERE		TXT_DEPARTAMENTO = vTXT_DEPARTAMENTO
			AND TXT_PROVINCIA = vTXT_PROVINCIA
			AND TXT_DISTRITO != '00'
	ORDER BY Nombre;
END ;;
