CREATE DEFINER=`root`@`%` PROCEDURE `SP_COMBO_UNIDAD_BY_PRODUCTO`(
	pPRODUCTO int(11)
)
BEGIN
	SELECT 	  uni.ID_UNIDAD AS Codigo
			, CONCAT(TXT_COD_UND, ' - ', TXT_DESCRIPCION) AS Nombre
	FROM 	tbl_unidad_medida uni INNER JOIN tbl_producto_unidades pro ON   uni.ID_UNIDAD = pro.ID_UNIDAD 
																		AND pro.ID_PRODUCTO = pPRODUCTO
    ORDER BY TXT_COD_UND;
END ;;
