CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTAR_NUEVO_COD_SERIE`(
	  pSERIE varchar(10)
    , pEMISOR int
    , pPROCESO int
    , pTIP_DOC char(1)
)
BEGIN
    SELECT 	CONCAT(LPAD((NUM_SECUENCIA + 1), 8, '0')) AS CODIGO
    FROM 	tbl_inv_serie
    WHERE 	ID_PROCESO = pPROCESO
		AND TXT_SERIE = pSERIE
		AND ID_EMISOR = pEMISOR
        AND TIP_DOC = pTIP_DOC;
END ;;
