CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTAS_BAJAS`(in pCOD_CLIENTE_EMIS int(11), in pCOD_LOCAL char(5) )
BEGIN
  start transaction;
  select cpe.NUM_CPE ,
cpe.FEC_EMIS, cpe.FEC_GENER_BAJA ,cpe.NOM_RZN_SOC_RECP,
tipcpe.TXT_DESCR_CPE as COD_TIP_CPE ,
 concat(cpe.TXT_SERIE,'-' ,cpe.TXT_CORRELATIVO ) as SERIE_CORRELATIVO, loc.NOMBRE_LOCAL from tbl_cpe_cabecera as cpe  inner join tbl_local as loc on 
 cpe.COD_LOCAL = loc.COD_LOCAL inner join tbl_cpe as tipcpe on tipcpe.COD_TIP_CPE = cpe.COD_TIP_CPE  where   cpe.COD_CLIENTE_EMIS =pCOD_CLIENTE_EMIS and cpe.COD_IDEN_CB='C' and cpe.COD_LOCAL=pCOD_LOCAL ; 
  commit;
END ;;
