CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_COMPROBANTESEMISORXFECHA`(in pCodEmisor int(11), in pFechaInicio datetime, in pFechaFin datetime)
BEGIN
select cab.NUM_CPE, cab.COD_TIP_CPE, cab.COD_CLIENTE_EMIS, cab.NUM_RUC_EMIS, cab.FEC_EMIS, 
cab.TXT_SERIE, cab.TXT_CORRELATIVO, cab.COD_CPE_REF, cab.TXT_SERIE_REF, cab.TXT_CORRELATIVO_CPE_REF, 
cab.MNT_TOT, cab.COD_MND, cab.TXT_CONDICION_PAGO, 
cab.GUIA_TXT_COD_UBIG, cab.GUIA_TXT_DMCL_FISC, cab.GUIA_TXT_URB, cab.GUIA_TXT_PROV, 
cab.GUIA_TXT_DPTO, cab.GUIA_TXT_DISTR, det.TXT_DESCR_ITEM, cab.COD_ESTADO_SUNAT, cab.COD_ESTADO_DOC
from tbl_cpe_cabecera as cab inner join tbl_cpe_det_cabecera as det on cab.NUM_CPE=det.NUM_CPE 
where det.NUM_LIN_ITEM=1 and cab.COD_CLIENTE_EMIS=pCodEmisor 
and date(FEC_EMIS) between pFechaInicio and pFechaFin order by cab.NUM_CPE asc;

END ;;
