CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_COTIZACIONES`(
in pID int
)
BEGIN

	select 
		c.NUM_CPE as CPE_ID, 
		c.TXT_SERIE as SERIE,
		c.TXT_CORRELATIVO as CORRELATIVO,
		c.FEC_EMIS as FECHACREADO,
		c.NOM_RZN_SOC_RECP as RAZONSOCIAL,
		c.NUM_IDEN_RECP as NUMRUC,
		c.MNT_TOT_GRAVADAS as GRAVADAS,
		c.MNT_TOT_IGV as IGV,
		c.MNT_TOT as MONTO_TOTAL,
        a.ID_ADQ as ID_ADQ
    from tbl_cotizacion c inner join tbl_adquiriente a on c.NUM_IDEN_RECP = a.NUM_IDEN_RECP
	where c.COD_CLIENTE_EMIS = pID and a.COD_CLIENTE_EMIS = pID
    order by CPE_ID desc;
    
END ;;
