CREATE DEFINER=`root`@`%` PROCEDURE `SP_CONSULTA_SI_EXISTEN_CPES_GUIA_REMISION_POR_CARGAR_PENDIENTES`()
BEGIN
	select 
		gr.ID_EMISOR as idCliente,
        concat(parm.TXT_VALOR_PARAMETRO,':',parm.TXT_VALOR_PARAMETRO2) AS credencialesWs,
        count(gr.ID_GUIA) as cantidad
    from tbl_guia_remision gr
    inner join tbl_cliente_parametros as parm 
		on gr.ID_EMISOR = parm.COD_EMISOR 
	where
		 parm.COD_PARAMETRO = '023' and
         gr.TIP_DOC = 'E' and
         gr.FLAG_CARGA = '0'
	group by gr.ID_EMISOR
    order by length(gr.ID_EMISOR), gr.ID_EMISOR;
END ;;
