			, TXT_NOMBRE
			, TXT_DESCRIPCION
			, TXT_DIRECCION
			, ID_UBIGEO
			, ID_EMISOR
            , CHR_ESTADO
			, FEC_REGISTRO
			, ID_USUARIO		
