in pTXT_TOTAL_EN_LETRAS varchar(120), 
in pESTADO_DOC char(2), 
in pESTADO_SUNAT char(3), 
-- in pCOD_TIP_NC_ND_REF char(2), 
-- in pTXT_SERIE_REF char(4), 
-- in pTXT_CORRELATIVO_CPE_REF varchar(12), 
-- in pCOD_CPE_REF char(2), 
-- in pTXT_SUSTENTO varchar(120), 
in pTXT_CORREO_ADQUIRIENTE varchar(150),
in pCOD_LOCAL char(5),
in pFEC_VENCI datetime, 
in pFLAG_ISC CHAR(1), 
in pFLAG_PAGADO CHAR(1), 
in pTXT_ENVIO_SUNAT varchar(45), 
in pTIPO_OPERACION char(4), 
in pTXT_CONDICION_PAGO VARCHAR(100), 
in pMODO_PAGO char(4), 
in pTIPO_CAMBIO decimal(12,2), 
in pUSUARIO_VEND bigint(20),
in pTXT_OBSERV varchar(300),
in pTIPO_PERCEPCION varchar(10),
in pGUIA_TXT_COD_UBIG varchar(20) , 
in pGUIA_TXT_DMCL_FISC varchar(250) , 
in pGUIA_TXT_URB varchar(30)  ,
in pGUIA_TXT_PROV varchar(30)  ,
in pGUIA_TXT_DPTO varchar(30)  ,
in pGUIA_TXT_DISTR varchar(30)  ,
in pGUIA_TXT_PAIS varchar(30)  ,
in pGUIA_COD_UBIG_LLEGDA varchar(20)  ,
in pGUIA_TXT_DMCL_FISC_LLEGDA varchar(250) , 
in pGUIA_TXT_URB_LLEGDA varchar(30)  ,
in pGUIA_TXT_PROV_LLEGDA varchar(30) ,
in pGUIA_TXT_DPTO_LLEGDA varchar(30)  ,
in pGUIA_TXT_DISTR_LLEGDA varchar(30)  ,
in pGUIA_TXT_PAIS_LLEGDA varchar(30) , 
in pGUIA_TXT_PLACA_AUTO_TRNSP varchar(20) ,
in pGUIA_TXT_CERT_AUTO_TRNSP varchar(35)  ,
in pGUIA_TXT_MARCA_AUTO_TRNSP varchar(50) ,
in pGUIA_TXT_LIC_COND_TRNSP varchar(20) , 
in pGUIA_TXT_RUC_TRNSP varchar(11)  ,
in pGUIA_TXT_COD_OTR_TRNSP varchar(10)  ,
in pGUIA_TXT_RZN_SCL_TRNSP varchar(250) , 
in pGUIA_TXT_COD_MOD_TRNSP varchar(30) ,
in pGUIA_MNT_TOTAL_BRUTO decimal(15,2)  ,
in pGUIA_COD_UNID_MED varchar(20) ,
in pMARCA_EXPOR varchar(150),
in pORIGEN_EXPOR VARCHAR(50),
in pDESPACHO_EXPOR VARCHAR(50),
in pSOLDTO_EXPOR VARCHAR(300),
in pSHIITO_EXPOR VARCHAR(300),
in pNUMEROCAJAS_EXPOR char(10),
in pPESOBRUTO_EXPOR decimal(12,2) ,
in pPESONETO_EXPOR decimal(12,2),
in pVOLUMEN_EXPOR decimal(12,2),
in pORDEN_COMPRA VARCHAR(300),
in pGUIA_REMISION VARCHAR(300),
in pMNT_TOT_DETRAC decimal(12,2),
in pPERCENT_DETRAC varchar(5),
in pDESCRIP_DETRAC varchar(100),
in pNUM_CTA_BN varchar(20),
in pTIP_DETRAC char(1),
in pINFOS_DETRAC varchar(100),
in pESTAD_ITEM CHAR(1),
in pGUIA BIT,
in pTRANSPORTISTA_PEDIDO varchar(120),
in pNUMERO_PEDIDO varchar(12),
in pCOD_TIP_FRMPGO int,
in pMNTO_CRDT_TTAL decimal(12,2),
out mensaje varchar (300),
out pNumcpe int(11)
)
BEGIN

	declare resultado int;
    declare tempCorrelativo varchar(12);

	/*DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN
    
	SHOW ERRORS LIMIT 1;
			
	ROLLBACK;
	END; 
    
    DECLARE EXIT HANDLER FOR SQLWARNING
	BEGIN
	SHOW WARNINGS LIMIT 1;
	
	ROLLBACK;
	END;*/
	select count(*) into resultado from tbl_cpe_cabecera where CONCAT(TXT_SERIE,'', TXT_CORRELATIVO) = CONCAT(pSerie,'', pCorrelativo) AND COD_TIP_CPE = pCOD_TIP_CPE 
    AND COD_IDEN_CB <> 'C' AND COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS AND COD_ESTADO_DOC = '06';
    if resultado then
		DELETE FROM tbl_cpe_cabecera WHERE CONCAT(TXT_SERIE,'', TXT_CORRELATIVO) = CONCAT(pSerie,'', pCorrelativo) AND COD_TIP_CPE = pCOD_TIP_CPE 
		AND COD_IDEN_CB <> 'C' AND COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS AND COD_ESTADO_DOC = '06';
	end if;
    
	/*
	select count(*) into resultado from tbl_cpe_cabecera where CONCAT(TXT_SERIE,'', TXT_CORRELATIVO) = CONCAT(pSerie,'', pCorrelativo) AND COD_TIP_CPE = pCOD_TIP_CPE 
    AND COD_IDEN_CB <> 'C' AND COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS;
	if resultado then
		set mensaje = 'Serie-correlativo ya existe';
        set pNumcpe = 0;
		select mensaje, pNumcpe;
	else */
    
	-- start transaction;
    -- commit;
                        
	if (pCOD_CLIENTE_EMIS <> 3 and pCOD_CLIENTE_EMIS <> 153) then
		set tempCorrelativo = (select 
							lpad(ifnull(max(TXT_CORRELATIVO), 0) + 1,8,0)
						from tbl_cpe_cabecera 
						where COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS 
							and COD_TIP_CPE = pCOD_TIP_CPE
							and TXT_SERIE = pSerie 
							and COD_IDEN_CB <> 'C');
