    AND COD_IDEN_CB <> 'C' AND COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS AND COD_ESTADO_DOC = '06';
    
    if resultado then
		DELETE FROM tbl_cotizacion WHERE CONCAT(TXT_SERIE,'', TXT_CORRELATIVO) = CONCAT(pSerie,'', pCorrelativo) AND COD_TIP_CPE = pCOD_TIP_CPE 
		AND COD_IDEN_CB <> 'C' AND COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS AND COD_ESTADO_DOC = '06';
