					GUIA_TXT_PLACA_AUTO_TRNSP ,
					GUIA_TXT_CERT_AUTO_TRNSP  , 
					GUIA_TXT_MARCA_AUTO_TRNSP ,
					GUIA_TXT_LIC_COND_TRNSP,
					GUIA_TXT_RUC_TRNSP  ,
					GUIA_TXT_COD_OTR_TRNSP,
					GUIA_TXT_RZN_SCL_TRNSP  ,
					GUIA_TXT_COD_MOD_TRNSP ,
					GUIA_MNT_TOTAL_BRUTO  ,
