                    ORDEN_COMPRA, GUIA_REMISION ,
                    MARCA_EXPOR, ORIGEN_EXPOR, DESPACHO_EXPOR, SOLDTO_EXPOR, SHIITO_EXPOR, NUMEROCAJAS_EXPOR,
