                    ESTAD_ITEM, COD_TIP_FRMPGO, MNTO_CRDT_TTAL)
                  
                  -- TXT_DESCR_MOTIVO_BAJA ,FEC_RECP_DOC1 ,COD_IDEN_COM_BAJA ,  FEC_GENER_BAJA , FK_NUM_CPE_INTERMEDIA ) 
                  
                  
                  values(pFechaemision,pSerie , pCorrelativo, pCOD_TIP_ESCENARIO ,pTXT_PLACA, pCOD_CLIENTE_EMIS ,pNUM_RUC_EMIS,
                    pNOM_RZN_SOC_EMIS,pCOD_TIP_NIF_EMIS,pCOD_UBI_EMIS,pTXT_DMCL_FISC_EMIS ,pTXT_PROV_EMIS,pTXT_DPTO_EMIS,
                    pTXT_DISTR_EMIS ,pTXT_URB_EMIS ,pCOD_TIP_CPE, pCOD_MND , pNUM_IDEN_RECP , pCOD_TIP_NIF_RECP, pNOM_RZN_SOC_RECP, pTXT_DMCL_FISC_RECEP,
                    pMNT_TOT_IGV, pMNT_TOT_IGV_ISC, pMNT_TOT_ICBPER, pMNT_GRAVADAS, pMNT_INAFECTAS,pMNT_EXONERADAS,pMNT_GRATUITA,
                    pMNT_DESCUENTO_TOTAL,
                    pMNT_TOTAl , pMNT_TOT_BASE_IMPONIBLE , pMNT_PERCEPCION ,pMNT_TOT_A_PERCIBIR, pTXT_TOTAL_EN_LETRAS,
                    pESTADO_DOC,pESTADO_SUNAT, '',
                    pCOD_TIP_NC_ND_REF,pTXT_SERIE_REF,pTXT_CORRELATIVO_CPE_REF,pCOD_CPE_REF,pTXT_SUSTENTO,
                    pTXT_CORREO_ADQUIRIENTE, pCOD_LOCAL,
