CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_CABECERA_PORTAL`(in pNUM_CPE_INTERMEDIA int(11),
 in pCOD_TIP_CPE char(2) , in pCOD_MND char(3),
 in pCOD_ESTADO_DOC char(2), in pCOD_ESTADO_SUNAT char(3),in pCOD_CLIENTE_EMIS char(1),
 in pNUM_RUC_EMIS varchar(11) ,in pNOM_RZN_SOC_EMIS varchar(100), in pCOD_TIP_NIF_EMIS varchar(1),
 in pCOD_UBI_EMIS varchar(10), in  pTXT_DMCL_FISC_EMIS varchar(100), in pTXT_URB_EMIS varchar(30),
 in pTXT_PROV_EMIS varchar(30),in pTXT_DPTO_EMIS varchar(30),in pTXT_DISTR_EMIS varchar(30),
 in pTXT_SERIE char(4), in pTXT_CORRELATIVO varchar(12),  in pCOD_TIP_ESCENARIO char(2),in pTXT_PLACA varchar(10),
 in pNUM_IDEN_RECP varchar(20),
 in pCOD_TIP_NIF_RECP char(1),in pNOM_RZN_SOC_RECP varchar(120),in pTXT_DMCL_FISC_RECEP varchar(120),
 in pMNT_TOT_GRAVADAS decimal(12,2),in pMNT_TOT_INAFECTAS decimal(12,2),in pMNT_TOT_EXONERADAS decimal(12,2),
 in pMNT_TOT_GRATUITAS decimal(12,2),in pMNT_TOT_DESC_GLOBAL decimal(12,2),  in pMNT_TOT_IGV decimal(12,2),
 in pMNT_TOT_IGV_ISC decimal(12,2),in pMNT_TOT_BASE_IMPONIBLE decimal(12,2),in pMNT_TOT_PERCEPCION decimal(12,2),
 in pMNT_TOT_A_PERCIBIR decimal(12,2),in pMNT_TOT decimal(12,2),  in pTXT_DESCR_MOTIVO_BAJA varchar(120),
 in pCOD_TIP_NC_ND_REF char(2), in pTXT_CORRELATIVO_CPE_REF varchar(12),in pTXT_SERIE_REF char(4),
 in pCOD_CPE_REF char(2), 
 in pTXT_SUSTENTO varchar(120),in pFEC_EMIS datetime,in pFEC_RECP_DOC1 datetime,in pFLAG_NUM_INT char(2),
 in pFLAG_ENVIO_BOLETAS char(1), in pCOD_IDEN_CB char(2),  in pCOD_IDEN_RD varchar(14),
 in pCOD_IDEN_COM_BAJA char(2), in pFEC_GENER_BAJA datetime,in pTXT_CORREO_ADQUIRIENTE varchar(150), 
 in pFLAG_CORREO char(1),in pTXT_RESP char(2), out pNumcpe int(11) )
BEGIN
	
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
                BEGIN
    
                SHOW ERRORS LIMIT 1;
                                               
                ROLLBACK;
                END; 
    
    DECLARE EXIT HANDLER FOR SQLWARNING
                BEGIN
                SHOW WARNINGS LIMIT 1;
                
                ROLLBACK;
                END;
                 start transaction;
				  insert into tbl_cpe_cabecera (COD_TIP_CPE ,  COD_MND ,
				  COD_ESTADO_DOC ,  COD_ESTADO_SUNAT , COD_CLIENTE_EMIS ,
                   NUM_RUC_EMIS  , NOM_RZN_SOC_EMIS ,  COD_TIP_NIF_EMIS ,
				  COD_UBI_EMIS ,   TXT_DMCL_FISC_EMIS ,  TXT_URB_EMIS ,
				  TXT_PROV_EMIS , TXT_DPTO_EMIS , TXT_DISTR_EMIS ,
				  TXT_SERIE ,  TXT_CORRELATIVO ,   COD_TIP_ESCENARIO , TXT_PLACA ,
				  NUM_IDEN_RECP ,
				  COD_TIP_NIF_RECP , NOM_RZN_SOC_RECP , TXT_DMCL_FISC_RECEP ,
				  MNT_TOT_GRAVADAS , MNT_TOT_INAFECTAS , MNT_TOT_EXONERADAS ,
				  MNT_TOT_GRATUITAS , MNT_TOT_DESC_GLOBAL ,   MNT_TOT_IGV ,
				  MNT_TOT_IGV_ISC , MNT_TOT_BASE_IMPONIBLE , MNT_TOT_PERCEPCION ,
				  MNT_TOT_A_PERCIBIR , MNT_TOT ,   TXT_DESCR_MOTIVO_BAJA ,
				  COD_TIP_NC_ND_REF ,  TXT_CORRELATIVO_CPE_REF , TXT_SERIE_REF , COD_CPE_REF , 
				  TXT_SUSTENTO , FEC_EMIS , FEC_RECP_DOC1 ,FEC_RECP_DOC2, FLAG_NUM_INT ,
				  FLAG_ENVIO_BOLETAS ,  COD_IDEN_CB ,   COD_IDEN_RD ,
				  COD_IDEN_COM_BAJA ,  FEC_GENER_BAJA ,TXT_CORREO_ADQUIRIENTE , 
				  FLAG_CORREO , TXT_RESP,FK_NUM_CPE_INTERMEDIA ) values (  pCOD_TIP_CPE  ,  pCOD_MND ,
				  '02' ,  pCOD_ESTADO_SUNAT , pCOD_CLIENTE_EMIS ,
                   pNUM_RUC_EMIS  , pNOM_RZN_SOC_EMIS ,  pCOD_TIP_NIF_EMIS ,
				  pCOD_UBI_EMIS ,   pTXT_DMCL_FISC_EMIS ,  pTXT_URB_EMIS ,
				  pTXT_PROV_EMIS , pTXT_DPTO_EMIS , pTXT_DISTR_EMIS ,
				  pTXT_SERIE ,  pTXT_CORRELATIVO ,   pCOD_TIP_ESCENARIO , pTXT_PLACA ,
				  pNUM_IDEN_RECP ,  pCOD_TIP_NIF_RECP , pNOM_RZN_SOC_RECP , pTXT_DMCL_FISC_RECEP ,
				  pMNT_TOT_GRAVADAS , pMNT_TOT_INAFECTAS , pMNT_TOT_EXONERADAS ,
				  pMNT_TOT_GRATUITAS , pMNT_TOT_DESC_GLOBAL ,   pMNT_TOT_IGV ,
				  pMNT_TOT_IGV_ISC , pMNT_TOT_BASE_IMPONIBLE , pMNT_TOT_PERCEPCION ,
				  pMNT_TOT_A_PERCIBIR , pMNT_TOT ,   pTXT_DESCR_MOTIVO_BAJA ,
				  pCOD_TIP_NC_ND_REF ,  pTXT_CORRELATIVO_CPE_REF , pTXT_SERIE_REF , pCOD_CPE_REF , 
				  pTXT_SUSTENTO , pFEC_EMIS , pFEC_RECP_DOC1 , now(), '0' ,
				  pFLAG_ENVIO_BOLETAS ,  pCOD_IDEN_CB ,   pCOD_IDEN_RD ,
				  pCOD_IDEN_COM_BAJA ,  pFEC_GENER_BAJA, pTXT_CORREO_ADQUIRIENTE , 
				  pFLAG_CORREO , '1',pNUM_CPE_INTERMEDIA) ;
				  set pNumcpe = LAST_INSERT_ID(); 
                   
  
    commit;





END ;;
