    select count(*) into resultado from tbl_cpe_cabecera_retencion where CONCAT(TXT_SERIE,'', TXT_CORRELATIVO) = CONCAT(pSERIE,'', pCORRELATIVO) AND COD_TIP_CPE = pCOD_TIP_CPE 
