CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_DET_CABECERA`(
in pNUM_LIN_ITEM int(11), 
in pCOD_UNID_ITEM varchar(3), 
in pCANT_UNID_ITEM decimal(22,10), 
in pVAL_VTA_ITEM decimal(12,4),
in pCOD_TIP_SIST_ISC varchar(2), 
in pCOD_TIP_AFECT_IGV_ITEM varchar(3), 
in pPRC_VTA_UNIT_ITEM decimal(22,10), 
in pMNT_DSCTO_ITEM decimal(12,2), 
in pMNT_IGV_ITEM decimal(12,2) , 
in pMNT_ISC_ITEM decimal(12,2), 
in pTXT_DESCR_ITEM varchar(1000), 
in pCOD_ITEM varchar(30), 
in pVAL_UNIT_ITEM decimal(22,10), 
in pCOD_CLIENTE_EMIS char(5),
in pNUM_CPE int(11),
in pID_PROD int(11),
in pPORCENTAJE_ISC varchar(10),
in pIMPORTE_TOTAL_ITEM decimal(12,2),
in pVAL_UNIT_ICBPER decimal(12,5),
in pCANT_ICBPER_ITEM decimal(12,2),
in pMNT_ICBPER_ITEM decimal(12,2),
in pDATO_EXTRA_1 varchar(300),
in pDATO_EXTRA_2 varchar(300),
in pSERIE char(4), 
in pCORRELATIVO varchar(12), 
in pUSUARIO bigint(20),
in pID_ALMACEN int(11), 
in pTXT_LOTE varchar(20), 
in pFEC_VENCIMIENTO DateTime,
in pID_GUIA int(11),
in pINT_LINEA int(11),
out num_det_cabecera int,
out mensaje varchar(300)
)
BEGIN

				declare resultado int;
                declare proceso varchar(1);
                declare factor decimal(13,2);
                declare EsServicio bit(1);
                
				/*DECLARE EXIT HANDLER FOR SQLEXCEPTION
                BEGIN
    
                SHOW ERRORS LIMIT 1;
                                               
                ROLLBACK;
                END; 
    
				DECLARE EXIT HANDLER FOR SQLWARNING
                BEGIN
                SHOW WARNINGS LIMIT 1;
                
                ROLLBACK;
                END;*/
                -- start transaction;
                insert into  tbl_cpe_det_cabecera (NUM_LIN_ITEM,
													COD_UNID_ITEM,
													CANT_UNID_ITEM, 
													VAL_VTA_ITEM, 
                                                    COD_TIP_SIST_ISC, 
													COD_TIP_AFECT_IGV_ITEM,
													PRC_VTA_UNIT_ITEM, 
													MNT_DSCTO_ITEM, 
													MNT_IGV_ITEM, 
                                                    MNT_ISC_ITEM, 
													TXT_DESCR_ITEM,
													COD_ITEM, 
													VAL_UNIT_ITEM, 
													COD_CLIENTE_EMIS, 
													NUM_CPE,
                                                    ID_PRODUCTO,
                                                    PORCENTAJE_ISC,
                                                    IMPORTE_TOTAL_ITEM,
                                                    VAL_UNIT_ICBPER,
													CANT_ICBPER_ITEM,
													MNT_ICBPER_ITEM,
                                                    DATO_EXTRA_1,
                                                    DATO_EXTRA_2, 
                                                    TXT_LOTE,
                                                    FEC_VENCIMIENTO,
                                                    ID_UBICACION,
                                                    CANT_UNID_GR
													) values(
                                                     pNUM_LIN_ITEM , 
										pCOD_UNID_ITEM , 
										pCANT_UNID_ITEM , 
										pVAL_VTA_ITEM ,
                                        pCOD_TIP_SIST_ISC , 
										pCOD_TIP_AFECT_IGV_ITEM , 
										pPRC_VTA_UNIT_ITEM , 
										pMNT_DSCTO_ITEM , 
										pMNT_IGV_ITEM , 
                                        pMNT_ISC_ITEM , 
										pTXT_DESCR_ITEM , 
										pCOD_ITEM , 
										pVAL_UNIT_ITEM , 
										pCOD_CLIENTE_EMIS,
										pNUM_CPE,
                                        pID_PROD,
                                        pPORCENTAJE_ISC,
                                        pIMPORTE_TOTAL_ITEM,
                                        pVAL_UNIT_ICBPER,
										pCANT_ICBPER_ITEM,
										pMNT_ICBPER_ITEM,
                                        pDATO_EXTRA_1,
                                        pDATO_EXTRA_2,
                                        pTXT_LOTE, 
                                        pFEC_VENCIMIENTO,
                                        pID_ALMACEN,
                                        if(pID_GUIA IS NULL, 0, CANT_UNID_ITEM));
                
                set mensaje = 'Se registro correctamente';
				set resultado = 1;
				set num_det_cabecera = last_insert_id();
				if(num_det_cabecera > 0 AND num_det_cabecera is not null) then
					/* Modulo de Inventario - Guillermo Perozo - 10/12/2018 */
                    SET proceso = null;
                    
					select  TXT_VALOR_PARAMETRO into proceso
					from	tbl_cliente_parametros
					where 	COD_PARAMETRO = '037' and COD_EMISOR = pCOD_CLIENTE_EMIS;
					
					if (proceso = 'I' AND proceso is not null) then
                        if (pID_GUIA IS NULL) then
							SET factor = 1;
                            SET EsServicio = 0;
							
                            SELECT 	Prod.BIT_INVENTARIO INTO EsServicio
                            FROM	tbl_producto Prod
							WHERE	Prod.ID_EMISOR = pCOD_CLIENTE_EMIS AND Prod.ID_PRODUCTO = pID_PROD;
                            
                            if (EsServicio = 0) then
								SELECT  PrUn.DEC_FACTOR INTO factor
								FROM 	tbl_producto_unidades PrUn INNER JOIN tbl_unidad_medida Unid ON PrUn.ID_UNIDAD = Unid.ID_UNIDAD 
																									AND PrUn.ID_PRODUCTO = pID_PROD
																									AND Unid.TXT_COD_UND = pCOD_UNID_ITEM;
								
								UPDATE 	tbl_inventario Inve
								SET  	Inve.NUM_CANTIDAD = Inve.NUM_CANTIDAD - (pCANT_UNID_ITEM / factor)
								WHERE	Inve.ID_EMISOR = pCOD_CLIENTE_EMIS
									AND	Inve.ID_PRODUCTO = pID_PROD
									AND Inve.ID_UBICACION = pID_ALMACEN
									AND Inve.TXT_LOTE = pTXT_LOTE
									AND IFNULL(Inve.FEC_VENCIMIENTO, DATE('1000-01-01')) = IFNULL(pFEC_VENCIMIENTO, DATE('1000-01-01'));
				   
								UPDATE 	tbl_producto Prod
								SET  	Prod.DEC_STOCK = Prod.DEC_STOCK - (pCANT_UNID_ITEM / factor)
								WHERE	Prod.ID_EMISOR = pCOD_CLIENTE_EMIS AND Prod.ID_PRODUCTO = pID_PROD AND Prod.BIT_INVENTARIO = 0;
								
								CALL SP_INSERTAR_INV_MOVIMIENTO
								(
									  pCOD_CLIENTE_EMIS
									, pID_PROD
									, 1
									, 1
									, pSERIE
									, pCORRELATIVO
									, (pCANT_UNID_ITEM / factor)
									, 0
									, 0
									, pNUM_CPE
									, pUSUARIO
								);
                            end if;
						else
							UPDATE  tbl_guia_remision_detalle
                            SET 	DEC_CANTIDAD_FAC = DEC_CANTIDAD_FAC + pCANT_UNID_ITEM
                            WHERE		ID_GUIA = pID_GUIA
									AND INT_LINEA = pINT_LINEA
									AND ID_PRODUCTO = pID_PROD;
							
                            UPDATE  tbl_guia_remision
                            SET 	BIT_FACTURADO = (	SELECT  (COUNT(*) = 0)
														FROM 	tbl_guia_remision_detalle
														WHERE	ID_GUIA = pID_GUIA
															AND DEC_CANTIDAD > DEC_CANTIDAD_FAC	)
                            WHERE	ID_GUIA = pID_GUIA;
                            
                            CALL SP_INSERTAR_RELACION_FAC_GUIA(pNUM_CPE, pID_GUIA, 1);
						end if;
                    end if;
                    /* Fin de Modulo de Inventario */
					select mensaje, num_det_cabecera;
					-- commit;
				else
					set mensaje = 'Error, no se grabo el detalle';
					set resultado = 0;
                    set num_det_cabecera = 0;
					-- rollback;
					select mensaje, num_det_cabecera; 
				end if;	

END ;;
DELIMITER ;
