                                        pMNT_ISC_ITEM , 
										pTXT_DESCR_ITEM , 
										pCOD_ITEM , 
										pVAL_UNIT_ITEM , 
										pCOD_CLIENTE_EMIS,
										pNUM_CPE,
                                        pID_PROD,
                                        pPORCENTAJE_ISC,
                                        pIMPORTE_TOTAL_ITEM,
                                        pVAL_UNIT_ICBPER,
										pCANT_ICBPER_ITEM,
										pMNT_ICBPER_ITEM,
                                        pDATO_EXTRA_1,
