CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_ENTIDADES`(
in  pNUM_IDEN_RECP varchar(20), 
in pNOM_RZN_SOC_RECP varchar(120),
in pNOM_RZN_COMER varchar(120),
in pTXT_DMCL_FISC_RECEP varchar(500) , 
in pCOD_TIP_NIF_RECP  char(1), 
in pTXT_CORREO varchar(250),
in pTXT_TELEF_FIJO varchar(20), 
in pTXT_CEL1 varchar(20), 
in pTXT_CEL2 varchar(20),  
in pCOD_CLIENTE_EMIS int(11),
in pFLAG_TRANSPORTISTA char(1),
out pmensaje varchar(300),
out pid_adquiriente int(11)
)
BEGIN
    
    
     declare resultado int;
     
     select count(*) into resultado from tbl_adquiriente where NUM_IDEN_RECP = pNUM_IDEN_RECP 
     AND COD_CLIENTE_EMIS = pCOD_CLIENTE_EMIS;
     if resultado then
                               
        set pmensaje = 'Empresa ya se encuentra registrada';
        set pid_adquiriente = 0;
                               select pmensaje, pid_adquiriente;
        
                 else
     
     insert into tbl_adquiriente (
     NUM_IDEN_RECP,NOM_RZN_SOC_RECP,NOM_RZN_COMER,TXT_DMCL_FISC_RECEP,
                COD_TIP_NIF_RECP,TXT_CORREO,TXT_TELEF_FIJO,TXT_CEL1,TXT_CEL2,
                COD_CLIENTE_EMIS, FLAG_TRANSPORTISTA) 
     
     values(pNUM_IDEN_RECP ,pNOM_RZN_SOC_RECP, pNOM_RZN_COMER, pTXT_DMCL_FISC_RECEP,
                pCOD_TIP_NIF_RECP, pTXT_CORREO, pTXT_TELEF_FIJO , 
                 pTXT_CEL1, pTXT_CEL2, pCOD_CLIENTE_EMIS, pFLAG_TRANSPORTISTA);

                set pid_adquiriente =   LAST_INSERT_ID();
     set pmensaje = 'Empresa registrada correctamente';
                select pmensaje, pid_adquiriente;
     
     end if;

END ;;
