CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_PRODUCTO`(
  out pPRODUCTO 		int(11)
    , pCODIGO 			varchar(30)
	, pCODIGO_ALT 		varchar(30)
	, pCODIGO_SUNAT 	varchar(30)
	, pNOMBRE 			varchar(100)
	, pNOMBRE_ALT_1 	varchar(100)
	, pNOMBRE_ALT_2 	varchar(100)
	, pCLASE 			int(11)
	, pFAMILIA 			int(11)
	, pSEGMENTO 		int(11)
	, pUNIDAD_MED 		int(11)
	, pSTOCK_MIN 		decimal(13,2)
	, pESPECIFICACIONES varchar(120)
	, pPRECIO 			decimal(12,4)
    , pPRECIO_CON_IGV   decimal(12,4)
	, pTIP_AFEC_IGV 	varchar(3)
	, pSERIE 			bit(1)
	, pFOTO 			varchar(40)
	, pUSUARIO 			bigint(20)
	, pEMISOR 			int(11)
    , pPESO				decimal(13,2)
    , pUNIDAD_PESO		int(11)
    , pUNIDADES			varchar(8000)
    , pCANT_ENTERO		bit(1)
   , pINVENTARIO		bit(1)
)
BEGIN
	start transaction;
    
	INSERT INTO tbl_producto
		(	  TXT_CODIGO
			, TXT_CODIGO_ALT
			, TXT_CODIGO_SUNAT
			, TXT_NOMBRE
			, TXT_NOMBRE_ALT_1
			, TXT_NOMBRE_ALT_2
			, ID_CLASE
			, ID_FAMILIA
			, ID_SEGMENTO
			, ID_UNIDAD_MED
			, DEC_STOCK
			, DEC_STOCK_MIN
			, TXT_ESPECIFICACIONES
			, DEC_PRECIO
            , DEC_PRECIO_CON_IGV
			, COD_TIP_AFEC_IGV
			, BIT_SERIE
			, TXT_FOTO
			, CHR_ESTADO
			, ID_USUARIO
			, FEC_INGRESO
			, FEC_ACTUALIZA
			, ID_EMISOR
            , DEC_PESO
            , ID_UNIDAD_PESO
            , BIT_CANT_ENTERO
            , BIT_INVENTARIO
		)
	VALUES
		(  	  pCODIGO
			, pCODIGO_ALT
			, pCODIGO_SUNAT
			, pNOMBRE
			, pNOMBRE_ALT_1
			, pNOMBRE_ALT_2
			, pCLASE
			, pFAMILIA
			, pSEGMENTO
			, pUNIDAD_MED
			, 0
			, pSTOCK_MIN
			, pESPECIFICACIONES
			, pPRECIO
            , pPRECIO_CON_IGV
			, pTIP_AFEC_IGV
			, pSERIE
			, pFOTO
			, 'A'
			, pUSUARIO
			, now()
			, null
			, pEMISOR
            , pPESO
            , pUNIDAD_PESO
            , pCANT_ENTERO
            , pINVENTARIO
		);
        
	set pPRODUCTO = LAST_INSERT_ID();
    
	UPDATE 	tbl_producto
    SET 	TXT_FOTO = IF(pFOTO != '', CONCAT('PROD', LPAD(pPRODUCTO, 10, '0'), '.', SUBSTRING_INDEX(pFOTO,'.',-1)), '')
    WHERE	ID_PRODUCTO = pPRODUCTO;
    
    CALL SP_INSERTAR_PRODUCTO_UNIDADES(pPRODUCTO, pUNIDADES);
    
    commit;
END ;;
DELIMITER ;
