CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_PRODUCTO_UNIDADES`(pID_PRODUCTO int, pLISTADO VARCHAR(8000))
BEGIN
	DECLARE vINDEX INT;
	DECLARE vFILA JSON;
	DECLARE pJSON JSON;

	DELETE FROM tbl_producto_unidades WHERE ID_PRODUCTO = pID_PRODUCTO;
	SET pJSON = CAST(pLISTADO AS JSON);
	SET vINDEX = 0;
	SET vFILA = JSON_EXTRACT(pJSON, CONCAT("$[", vINDEX, "]"));

	WHILE NOT vFILA IS NULL DO
		IF NOT JSON_UNQUOTE(vFILA->'$.DEC_FACTOR') = '' THEN
			INSERT INTO tbl_producto_unidades
			SELECT    pID_PRODUCTO
					, CAST(JSON_UNQUOTE(vFILA->'$.ID_UNIDAD') AS UNSIGNED) AS UNIDAD
					, CAST(JSON_UNQUOTE(vFILA->'$.DEC_FACTOR') AS DECIMAL(15,4)) AS FACTOR;
		END IF;
		SET vINDEX = vINDEX + 1;
		SET vFILA = JSON_EXTRACT(pJSON, CONCAT("$[", vINDEX, "]"));
	END WHILE;
END ;;
DELIMITER ;
