CREATE DEFINER=`root`@`%` PROCEDURE `SP_INSERTAR_RELACION_FAC_GUIA`(
	  pNUM_CPE 	INT(11)
    , pGUIA		INT(11)
    , pPROCESO	INT(11)
)
BEGIN
	DECLARE vExiste BIT;
    SET vExiste = 0;
    
    SELECT  COUNT(*) INTO vExiste
    FROM 	tbl_relacion_factura_guia
    WHERE 	NUM_CPE = pNUM_CPE
		AND ID_GUIA = pGUIA;
        
	IF (!vExiste) then
		INSERT INTO tbl_relacion_factura_guia VALUES (pNUM_CPE, pGUIA, pPROCESO);
    end if;
END ;;
DELIMITER ;
