CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_ALMACEN`(pEmisor INT, pClave VARCHAR(100))
BEGIN
	SELECT 	  Alma.ID_ALMACEN
			, Alma.COD_ALMACEN
			, Alma.TXT_NOMBRE
			, Alma.TXT_DESCRIPCION
			, Alma.ID_UBIGEO
            , Ubig.TXT_DEPARTAMENTO
            , Ubig.TXT_PROVINCIA
            , Ubig.TXT_DISTRITO
			, Alma.CHR_ESTADO
	FROM 	tbl_almacen Alma INNER JOIN vis_ubigeo Ubig ON Alma.ID_UBIGEO = Ubig.COD_DITRITO
    WHERE	Alma.ID_EMISOR = pEmisor
			AND (
					Alma.COD_ALMACEN		LIKE pClave
				OR	Alma.TXT_NOMBRE 		LIKE pClave
				OR	Alma.TXT_DESCRIPCION	LIKE pClave
				OR	Ubig.TXT_DEPARTAMENTO 	LIKE pClave
				OR	Ubig.TXT_PROVINCIA		LIKE pClave
				OR	Ubig.TXT_DISTRITO 		LIKE pClave
				OR  pClave = ''
            )
	ORDER BY Alma.TXT_NOMBRE;
END ;;
DELIMITER ;
