CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_CLASE`(
	  pEMISOR int(11)
	, pCLAVE  varchar(100)
)
BEGIN
	SELECT	  Clas.ID_CLASE
			, Clas.TXT_CODIGO
			, Clas.TXT_NOMBRE
			, IF(Clas.TXT_ESTADO = 'A', 'Activo', 'Desactivado') AS TXT_ESTADO 
			, Clas.ID_FAMILIA
            , Fami.TXT_NOMBRE AS NOM_FAMILIA
			, Clas.ID_SEGMENTO
            , Segm.TXT_NOMBRE AS NOM_SEGMENTO
    FROM	tbl_clase Clas 	INNER JOIN tbl_segmento Segm ON Clas.ID_SEGMENTO = Segm.ID_SEGMENTO
							INNER JOIN tbl_familia Fami ON Clas.ID_FAMILIA = Fami.ID_FAMILIA
    WHERE 	(	pCLAVE = ''
			OR	Clas.TXT_CODIGO LIKE pCLAVE
            OR 	Clas.TXT_NOMBRE LIKE pCLAVE 
            OR 	Fami.TXT_NOMBRE LIKE pCLAVE 
            OR 	Segm.TXT_NOMBRE LIKE pCLAVE )
		AND Clas.ID_EMISOR = pEMISOR
	ORDER BY Clas.TXT_NOMBRE;
END ;;
DELIMITER ;
