CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_FACBOL_DETALLE_PENGR`(
	  pNUM_DOC INT(11)
    , pEMISOR  INT(11)
    , pALMACEN INT(11)
    , pID_GUIA INT(11)
)
BEGIN
	SET @Secuencia = 0;
    
    DELETE FROM tbl_guia_remision_detalle WHERE ID_GUIA = pID_GUIA AND ID_CPE_DETALLE IS NULL;

	SELECT 	COUNT(*) INTO @Secuencia
    FROM 	tbl_guia_remision_detalle
    WHERE 	ID_GUIA = pID_GUIA;

	INSERT INTO tbl_guia_remision_detalle 
	SELECT 	  pID_GUIA
			, (@Secuencia := @Secuencia + 1) AS LINEA
            , Deta.ID_PRODUCTO
			, Deta.COD_ITEM
			, Deta.TXT_DESCR_ITEM
            , Unid.ID_UNIDAD
            , (Deta.CANT_UNID_ITEM - Deta.CANT_UNID_GR)
            , Prod.DEC_PESO
            , ''
            , Deta.TXT_LOTE
            , Deta.FEC_VENCIMIENTO
            , Deta.ID_UBICACION
            , ''
            , Prod.ID_UNIDAD_PESO
            , NULL
            , (Deta.CANT_UNID_ITEM - Deta.CANT_UNID_GR)
            , Deta.NUM_DET_CABECERA
	FROM 	tbl_cpe_det_cabecera Deta INNER JOIN tbl_ubicacion Ubic		ON  Ubic.ID_UBICACION = Deta.ID_UBICACION 
																		AND Ubic.ID_ALMACEN = pALMACEN
																		AND	Deta.NUM_CPE = pNUM_DOC
																		AND Deta.COD_CLIENTE_EMIS = pEMISOR
																		AND Deta.CANT_UNID_ITEM > Deta.CANT_UNID_GR
									  INNER JOIN tbl_unidad_medida Unid ON 	Deta.COD_UNID_ITEM = Unid.TXT_COD_UND
                                      INNER JOIN tbl_producto Prod 		ON 	Deta.ID_PRODUCTO = Prod.ID_PRODUCTO
                                      LEFT OUTER JOIN tbl_guia_remision_detalle Guia ON Deta.NUM_DET_CABECERA = Guia.ID_CPE_DETALLE AND Guia.ID_GUIA = pID_GUIA
	WHERE	Guia.ID_GUIA IS NULL;
                                      
	CALL SP_LISTAR_GUIA_REMISION_DETALLE(pID_GUIA, pEMISOR);
END ;;
DELIMITER ;
