CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_FACBOL_PENGR`(
	  pNUM_DOC VARCHAR(1000)
    , pEMISOR  INT(11)
    , pALMACEN INT(11)
)
BEGIN
	SELECT DISTINCT Cabe.NUM_CPE AS codigo
			, concat(Cabe.TXT_SERIE, '-', Cabe.TXT_CORRELATIVO) AS Correlativo
			, Cabe.NOM_RZN_SOC_RECP AS cliente
			, DATE_FORMAT(Cabe.FEC_EMIS, "%d/%m/%Y") AS fecha
	FROM 	tbl_cpe_cabecera Cabe INNER JOIN tbl_cpe_det_cabecera Deta ON   Cabe.NUM_CPE = Deta.NUM_CPE
																		AND concat(Cabe.TXT_SERIE, '-', Cabe.TXT_CORRELATIVO) LIKE concat('%',pNUM_DOC,'%') 
																		AND Cabe.COD_CLIENTE_EMIS = pEMISOR
																		AND Cabe.COD_TIP_CPE IN ('01', '03')
																		AND Cabe.COD_ESTADO_DOC != '06'
																		AND Cabe.BIT_GUIA = 0
								  INNER JOIN tbl_ubicacion Ubic	ON Ubic.ID_UBICACION = Deta.ID_UBICACION AND Ubic.ID_ALMACEN = pALMACEN;
END ;;
DELIMITER ;
