CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_FAMILIA`(
	  pEMISOR int(11)
	, pCLAVE  varchar(100)
)
BEGIN
	SELECT	  Fami.ID_FAMILIA
			, Fami.TXT_CODIGO
			, Fami.TXT_NOMBRE
			, IF(Fami.TXT_ESTADO = 'A', 'Activo', 'Desactivado') AS TXT_ESTADO 
			, Fami.ID_SEGMENTO
            , Segm.TXT_NOMBRE AS NOM_SEGMENTO
    FROM	tbl_familia Fami INNER JOIN tbl_segmento Segm ON Fami.ID_SEGMENTO = Segm.ID_SEGMENTO
    WHERE 	(	pCLAVE = ''
			OR	Fami.TXT_CODIGO LIKE pCLAVE
            OR 	Fami.TXT_NOMBRE LIKE pCLAVE
            OR 	Segm.TXT_NOMBRE LIKE pCLAVE)
