CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_GUIA_REMISION`(
	  pCLAVE 	varchar(80)
    , pEMISOR 	int(11)
    , pTIPDOC  char(1)
)
BEGIN
	SELECT 	  Guia.ID_GUIA
			, CONCAT(Guia.TXT_SERIE, '-', Guia.TXT_CORRELATIVO) AS TXT_CODIGO
			, Guia.TXT_NOMBRE_DESTINATARIO
            , DATE_FORMAT(Guia.FEC_EMISION, "%d/%m/%Y") AS FEC_EMISION
            , DATE_FORMAT(Guia.FEC_TRASLADO, "%d/%m/%Y") AS FEC_TRASLADO
			, Guia.TXT_DOMICILIO_PARTIDA AS TXT_PARTIDA
			, Guia.TXT_DOMICILIO_LLEGADA AS TXT_LLEGADA
			, Moti.TXT_NOMBRE AS TXT_MOTIVO
			, Guia.TXT_NOMBRE_TRANS
            , IF(IFNULL(Guia.CHR_ESTADO, '01') = '01', 'ACTIVO', 'ANULADO') AS TXT_ESTADO,
			(case COD_ESTADO_SUNAT 
				when '101' then 'EN PROCESO' 
				when '102' then 'ACEPTADO'
				when '103' then 'ACEPTADO CON OBS'
                when '104' then 'RECHAZADO'
                when '105' then 'ANULADO'
            end) as COD_ESTADO_SUNAT
            , Guia.TIP_DOC as TIP_DOC
    FROM 	tbl_guia_remision Guia INNER JOIN tbl_motivo_traslado Moti ON Guia.ID_MOTIVO = Moti.ID_MOTIVO
    WHERE	Guia.BIT_NUEVO = 0
		AND Guia.ID_EMISOR = pEMISOR
        AND Guia.TIP_DOC = pTIPDOC
	ORDER BY Guia.FEC_EMISION DESC;
END ;;
DELIMITER ;
