CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_GUIA_REMISION_DETALLE`(
	  pGUIA 		int(11)
	, pEMISOR 		int(11)
)
BEGIN
	SELECT	  DeGR.ID_GUIA
			, DeGR.INT_LINEA
			, DeGR.ID_PRODUCTO
			, DeGR.TXT_CODIGO_PROD
			, DeGR.TXT_NOMBRE_PROD
			, DeGR.ID_UNIDAD
			, DeGR.DEC_CANTIDAD
			, DeGR.DEC_PESO
			, DeGR.TXT_OBSERVACION
			, DeGR.TXT_LOTE
			, DATE_FORMAT(DeGR.FEC_VENCIMIENTO, "%d/%m/%Y") AS FEC_VENCIMIENTO
			, DeGR.ID_UBICACION
            , DeGR.TXT_SERIE
            , CONCAT(Alma.TXT_NOMBRE, ' - ', Ubic.TXT_NOMBRE) AS TXT_UBICACION
            , Unid.TXT_COD_UND AS Unidad
            , DeGR.ID_UNIDAD_PESO 
            , UnidP.TXT_CODIGO AS UnidadPeso
            , DeGR.ID_UBICACION_DEST
            , DeGR.DEC_CANTIDAD * DeGR.DEC_PESO AS TotalPeso
    FROM 	tbl_guia_remision_detalle DeGR 	INNER JOIN tbl_guia_remision Guia ON DeGR.ID_GUIA = Guia.ID_GUIA
											INNER JOIN tbl_ubicacion Ubic ON DeGR.ID_UBICACION = Ubic.ID_UBICACION
                                            INNER JOIN tbl_almacen Alma ON Ubic.ID_ALMACEN = Alma.ID_ALMACEN
                                            INNER JOIN tbl_unidad_medida Unid ON Unid.ID_UNIDAD = DeGR.ID_UNIDAD
                                            INNER JOIN tbl_unidad_peso UnidP ON UnidP.ID_UNIDAD_PESO = DeGR.ID_UNIDAD_PESO
    WHERE	DeGR.ID_GUIA = pGUIA
		AND Guia.ID_EMISOR = pEMISOR;
END ;;
DELIMITER ;
