CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_GUIA_REMISION_DETALLE_PENFAC`(
	  pGUIA INT
	, pEMISOR INT
)
BEGIN
	SELECT    Guia.ID_GUIA
			, Deta.INT_LINEA
			, Guia.TXT_SERIE
			, Guia.TXT_CORRELATIVO
            , (Prod.DEC_PRECIO / IFNULL(PrUn.DEC_FACTOR, 1)) AS DEC_PRECIO
			, IF (Guia.ID_MOTIVO = '6', '40', Prod.COD_TIP_AFEC_IGV)  as 'COD_TIP_AFEC_IGV'
            , Deta.DEC_CANTIDAD
            , (Deta.DEC_CANTIDAD - Deta.DEC_CANTIDAD_FAC) AS DEC_CANT_PEND
            , Unid.TXT_COD_UND
            , Deta.ID_PRODUCTO
            , Deta.TXT_CODIGO_PROD
            , Deta.TXT_NOMBRE_PROD
            , Deta.ID_UBICACION
            , Deta.TXT_OBSERVACION
	FROM 	tbl_guia_remision Guia INNER JOIN tbl_guia_remision_detalle Deta ON Guia.ID_GUIA = Deta.ID_GUIA AND Guia.BIT_NUEVO = 0 AND Guia.ID_EMISOR = pEMISOR AND Guia.ID_GUIA = pGUIA AND Guia.BIT_FACTURADO = 0
								   INNER JOIN tbl_producto Prod ON Deta.ID_PRODUCTO = Prod.ID_PRODUCTO
                                   INNER JOIN tbl_unidad_medida Unid ON Deta.ID_UNIDAD = Unid.ID_UNIDAD
                                   LEFT OUTER JOIN tbl_producto_unidades PrUn ON PrUn.ID_PRODUCTO = Deta.ID_PRODUCTO AND PrUn.ID_UNIDAD = Deta.ID_UNIDAD
	WHERE 	Deta.DEC_CANTIDAD > Deta.DEC_CANTIDAD_FAC;
END ;;
DELIMITER ;
