CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_GUIA_REMISION_PENFAC`(
	  pCODIGO VARCHAR(1000)
    , pEMISOR INT(11)
    , pCLIENTE INT(11)
    , pRESERVADA BIT(1)
)
BEGIN
	SELECT 	  Guia.ID_GUIA AS Id
			, CONCAT(Guia.TXT_SERIE,'-', Guia.TXT_CORRELATIVO) AS Codigo
            , DATE_FORMAT(Guia.FEC_EMISION, "%d/%m/%Y") AS Fecha
            , DATE_FORMAT(Guia.FEC_TRASLADO, "%d/%m/%Y") AS Traslado
            , Guia.TXT_RUC_DESTINATARIO AS RucDest
            , Guia.TXT_NOMBRE_DESTINATARIO AS NomDest
            , Moti.TXT_NOMBRE AS Motivo
            , Guia.TXT_NOMBRE_TRANS AS Transportista
			, Guia.TXT_SERIE
            , Guia.TXT_CORRELATIVO
            , Guia.TXT_RES_SERIE
            , Guia.TXT_RES_CORRELATIVO
            , Guia.COD_LOCAL
	FROM	tbl_guia_remision Guia  INNER JOIN tbl_motivo_traslado Moti ON Guia.ID_MOTIVO = Moti.ID_MOTIVO
	WHERE 	Guia.CHR_ESTADO = '01'
		AND Guia.BIT_NUEVO = 0 
		AND Guia.ID_MOTIVO != 8
		AND Guia.ID_EMISOR = pEMISOR 
		AND Guia.BIT_FACTURADO = 0
		AND ((CONCAT(Guia.TXT_SERIE,'-', Guia.TXT_CORRELATIVO) LIKE CONCAT('%', pCODIGO, '%')) OR pCODIGO = '')
		AND (Guia.ID_DESTINATARIO = pCLIENTE OR pCLIENTE = 0) 
		AND IF(pRESERVADA, (NOT Guia.TXT_RES_SERIE IS NULL AND DATE_FORMAT(Guia.FEC_EMISION, "%d/%m/%Y") = DATE_FORMAT(now(), "%d/%m/%Y")) 
						 , (    Guia.TXT_RES_SERIE IS NULL OR (NOT Guia.TXT_RES_SERIE IS NULL AND DATE_FORMAT(Guia.FEC_EMISION, "%d/%m/%Y") != DATE_FORMAT(now(), "%d/%m/%Y"))));
END ;;
