CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_INVENTARIO`(pEmisor INT, pClave VARCHAR(100))
BEGIN
	SELECT    Prod.ID_PRODUCTO
			, Prod.TXT_CODIGO
			, Prod.TXT_NOMBRE
			, UnMe.TXT_COD_UND 	AS NOM_UNIDAD
			, Prod.DEC_STOCK
			, Prod.DEC_PRECIO
            , Prod.DEC_PRECIO_CON_IGV
			, Prod.TXT_FOTO
			, IF(Prod.CHR_ESTADO = 'A', 'Activo', 'Desactivado') AS CHR_ESTADO
            , Inve.ID_UBICACION
            , Inve.NUM_CANTIDAD
            , IFNULL(Inve.TXT_LOTE, 'SIN LOTE') AS TXT_LOTE
            , DATE_FORMAT(Inve.FEC_VENCIMIENTO, "%d/%m/%Y") AS FEC_VENCIMIENTO
            , CONCAT(Alma.TXT_NOMBRE, ' - ', Ubic.TXT_NOMBRE) AS UBICACION
	FROM tbl_producto Prod 	INNER JOIN tbl_inventario Inve    ON Prod.ID_PRODUCTO = Inve.ID_PRODUCTO AND Prod.ID_EMISOR = Inve.ID_EMISOR
							INNER JOIN tbl_unidad_medida UnMe ON Prod.ID_UNIDAD_MED = UnMe.ID_UNIDAD
                            INNER JOIN tbl_ubicacion Ubic	  ON Inve.ID_UBICACION = Ubic.ID_UBICACION
                            INNER JOIN tbl_almacen Alma		  ON Ubic.ID_ALMACEN = Alma.ID_ALMACEN AND Alma.ID_EMISOR = Inve.ID_EMISOR
 	WHERE 		Prod.ID_EMISOR = pEmisor
			AND Inve.NUM_CANTIDAD > 0
			AND (
					Prod.TXT_CODIGO 		LIKE pClave
				OR	Prod.TXT_NOMBRE 		LIKE pClave
				OR  pClave = ''
            )
	ORDER BY Prod.TXT_NOMBRE, Ubicacion;
END ;;
DELIMITER ;
