    , pEMISOR 	int(11)
)
BEGIN
	SELECT 	  Entr.ID_ENTRADA
			, CONCAT(Entr.TXT_SERIE, '-', Entr.TXT_CORRELATIVO) AS TXT_CODIGO
			, TiMo.TXT_NOMBRE AS TXT_TIP_MOV
			, CONCAT(Alma.TXT_NOMBRE) AS TXT_UBICACION
			, Entr.TXT_NOM_PROV
			, DATE_FORMAT(Entr.FEC_INGRESO, "%d/%m/%Y") AS FEC_INGRESO
    FROM 	tbl_inv_entrada Entr INNER JOIN tbl_inv_tipo_movimiento TiMo ON Entr.ID_TIP_MOV = TiMo.ID_TIPO_MOV
                                 INNER JOIN tbl_Almacen Alma ON Alma.ID_ALMACEN = Entr.ID_ALMACEN
    WHERE	Entr.BIT_NUEVO = 0
		AND Entr.ID_EMISOR = pEMISOR
	ORDER BY Entr.FEC_INGRESO DESC;
END ;;
