CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_INV_MOVIMIENTO_BY_PRODUCTO`(
	  pPRODUCTO	int(11)
    , pEMISOR 	int(11)
)
BEGIN
	SELECT 	  Movi.ID_MOVIMIENTO
			, TiMo.TXT_NOMBRE AS TXT_TIPO_MOV
			, TiDo.TXT_NOMBRE AS TXT_TIPO_DOC
			, CONCAT(Movi.TXT_SERIE, '-', Movi.TXT_CORRELATIVO) AS TXT_CODIGO 
			, DATE_FORMAT(Movi.FEC_REGISTRO, "%d/%m/%Y") AS FEC_REGISTRO
			, IF (Movi.BIT_ENTRADA = 1, Movi.DEC_CANTIDAD, NULL) AS DEC_CANTIDAD_ENT
			, IF (Movi.BIT_ENTRADA = 1, Movi.DEC_COSTO, NULL) AS DEC_COSTO_ENT
			, IF (Movi.BIT_ENTRADA = 1, Movi.DEC_TOTAL, NULL) AS DEC_TOTAL_ENT
			, IF (Movi.BIT_ENTRADA = 0, Movi.DEC_CANTIDAD, NULL) AS DEC_CANTIDAD_SAL
			, IF (Movi.BIT_ENTRADA = 0, Movi.DEC_COSTO, NULL) AS DEC_COSTO_SAL
			, IF (Movi.BIT_ENTRADA = 0, Movi.DEC_TOTAL, NULL) AS DEC_TOTAL_SAL
			, Movi.DEC_CANTIDAD_SALDO
			, Movi.DEC_COSTO_SALDO
			, Movi.DEC_TOTAL_SALDO
            , Movi.ID_TIPO_DOC AS TIPO_DOC
            , Movi.ID_TIPO_MOV AS TIPO_MOV
            , Movi.ID_DOCUMENTO AS DOCUMENTO
            , Movi.BIT_ENTRADA AS ES_ENTRADA
	FROM 	tbl_inv_movimientos Movi 	INNER JOIN tbl_inv_tipo_movimiento TiMo ON Movi.ID_TIPO_MOV = TiMo.ID_TIPO_MOV
										INNER JOIN tbl_inv_tipo_documento TiDo 	ON Movi.ID_TIPO_DOC = TiDo.ID_TIPO_DOC
	WHERE	Movi.ID_PRODUCTO = pPRODUCTO
		AND Movi.ID_EMISOR = pEMISOR
	ORDER BY Movi.ID_MOVIMIENTO DESC;
END ;;
DELIMITER ;
