CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_MOTIVO_TRASLADO`(
	  pEMISOR int(11)
	, pCLAVE  varchar(100)
)
BEGIN
	SELECT	  ID_MOTIVO
			, TXT_COD_SUNAT
			, TXT_NOMBRE
			, IF (CHR_ESTADO = 'A', 'Activo', 'Desactivado') AS CHR_ESTADO 
