CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_PRODUCTOS`(pEmisor INT, pClave VARCHAR(100))
BEGIN
	SELECT    Prod.ID_PRODUCTO
			, Prod.TXT_CODIGO
			, Prod.TXT_CODIGO_ALT
			, Prod.TXT_CODIGO_SUNAT
			, Prod.TXT_NOMBRE
			, Prod.TXT_NOMBRE_ALT_1
			, Prod.TXT_NOMBRE_ALT_2
			, Clas.TXT_NOMBRE 	AS NOM_CLASE
			, Fami.TXT_NOMBRE 	AS NOM_FAMILIA
			, Segm.TXT_NOMBRE 	AS NOM_SEGMENTO
			, UnMe.TXT_COD_UND 	AS NOM_UNIDAD
			, Prod.DEC_STOCK
			, Prod.DEC_STOCK_MIN
			, Prod.TXT_ESPECIFICACIONES
			, Prod.DEC_PRECIO
            , Prod.DEC_PRECIO_CON_IGV
			, TiAf.TXT_DESCRIP_AFEC AS NOM_TIPO_AFEC_IGV
			, Prod.BIT_SERIE
			, Prod.TXT_FOTO
			, IF(Prod.CHR_ESTADO = 'A', 'Activo', 'Desactivado') AS CHR_ESTADO
            , CONCAT(Prod.DEC_PESO, ' ', UnPe.TXT_CODIGO) AS TXT_PESO
	FROM tbl_producto Prod 		INNER JOIN tbl_clase Clas 		 		ON Prod.ID_CLASE = Clas.ID_CLASE
								INNER JOIN tbl_familia Fami 	 		ON Prod.ID_FAMILIA = Fami.ID_FAMILIA
                                INNER JOIN tbl_segmento Segm 	 		ON Prod.ID_SEGMENTO = Segm.ID_SEGMENTO
                                INNER JOIN tbl_unidad_medida UnMe 		ON Prod.ID_UNIDAD_MED = UnMe.ID_UNIDAD
                                INNER JOIN tbl_unidad_peso UnPe 		ON Prod.ID_UNIDAD_PESO = UnPe.ID_UNIDAD_PESO
                                INNER JOIN tbl_tipo_afectacion_igv TiAf ON Prod.COD_TIP_AFEC_IGV = TiAf.COD_TIP_AFEC_IGV
 	WHERE 		Prod.ID_EMISOR = pEmisor
			AND (
					Prod.TXT_CODIGO 		LIKE pClave
				OR	Prod.TXT_NOMBRE 		LIKE pClave
				OR	Clas.TXT_NOMBRE 		LIKE pClave
				OR  pClave = ''
            )
	ORDER BY TXT_NOMBRE;
END ;;
DELIMITER ;
