CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_PROVEEDOR`(
	  pCLAVE varchar(100)
	, pEMISOR int(11)
)
BEGIN
	SELECT    Prov.ID_PROVEEDOR
			, Prov.TXT_NUM_RUC
			, Prov.TXT_RAZON
			, Prov.TXT_TELEF_1
			, Prov.TXT_TELEF_2
			, Prov.TXT_CONTACTO
			, Prov.TXT_EMAIL
			, IF(Prov.CHR_ESTADO = 'A', 'Activo', 'Desactivado') AS CHR_ESTADO
 	FROM	tbl_proveedor Prov
	WHERE 	(
			   Prov.TXT_NUM_RUC LIKE pCLAVE
            OR Prov.TXT_RAZON LIKE pCLAVE
            OR Prov.TXT_CONTACTO LIKE pCLAVE
            OR pCLAVE = '' )
		AND Prov.ID_EMISOR = pEMISOR;
END ;;
