CREATE DEFINER=`root`@`%` PROCEDURE `SP_LISTAR_UBICACION`(pEmisor INT, pClave VARCHAR(100))
BEGIN
	SELECT 	  Ubic.ID_UBICACION
			, Ubic.TXT_CODIGO
			, Ubic.TXT_NOMBRE
			, Ubic.TXT_DETALLE
			, Ubic.ID_ALMACEN
            , Alma.TXT_NOMBRE AS NOM_ALMACEN
			, IF (Ubic.CHR_ESTADO = 'A', 'Activo', 'Desactivado') AS TXT_ESTADO
	FROM 	tbl_ubicacion Ubic INNER JOIN tbl_Almacen Alma ON  Ubic.ID_ALMACEN =  Alma.ID_ALMACEN 
															AND Alma.ID_EMISOR = pEMISOR
	WHERE			Ubic.TXT_CODIGO	LIKE pClave
				OR	Ubic.TXT_NOMBRE LIKE pClave
				OR	Alma.TXT_NOMBRE LIKE pClave
				OR  pClave = ''
	ORDER BY Ubic.TXT_NOMBRE;
END ;;
DELIMITER ;
