CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_ADQUIRIENTES_AJAX`(
IN ID_EMISOR INT,
IN PARAMETRO_BUSQUEDA VARCHAR(30)
)
BEGIN

	SELECT 
		ID_ADQ AS id, 
        concat(NUM_IDEN_RECP,' | ',NOM_RZN_SOC_RECP) AS nombre,
        TXT_DMCL_FISC_RECEP AS direccion,
        TXT_CORREO as correo,
        '' as delivery
