CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_GUIA_REMISION_BY_ID`(
	  pGUIA 	int(11)
    , pEMISOR 	int(11)
)
BEGIN
	SELECT 	  Guia.ID_GUIA
			, Guia.TXT_SERIE
			, Guia.TXT_CORRELATIVO
			, Guia.TXT_RUC_DESTINATARIO
			, Guia.TXT_NOMBRE_DESTINATARIO
			, Guia.TXT_DIRECCION_DESTINATARIO
            , DATE_FORMAT(Guia.FEC_EMISION, "%d/%m/%Y") AS FEC_EMISION
            , DATE_FORMAT(Guia.FEC_TRASLADO, "%d/%m/%Y") AS FEC_TRASLADO
			, Guia.TXT_DOMICILIO_PARTIDA AS TXT_PARTIDA
			, Guia.TXT_DOMICILIO_LLEGADA AS TXT_LLEGADA
			, Guia.ID_MOTIVO
			, Moti.TXT_NOMBRE AS TXT_MOTIVO
			, Guia.TXT_NOMBRE_TRANS
			, Guia.TXT_RUC_TRANS
			, Guia.TXT_VEHICULO
			, Guia.TXT_PLACA
			, Guia.TXT_LICENCIA
			, Guia.TXT_ORDEN_COMPRA
			, Guia.TXT_FACTURA
            , Guia.ID_ALMACEN_PART
            , Guia.ID_ALMACEN_LLEG
            , Guia.TXT_RES_SERIE
            , Guia.TXT_RES_CORRELATIVO
            , Guia.COD_LOCAL
            , Guia.CHR_ESTADO
            , Guia.TXT_MOTIVO_ANULACION
            , Guia.ID_USUARIO_ANULACION
            , Guia.FEC_FECHA_ANULACION
            , TXT_OBSERVACION
            , Guia.TIP_DOC
			, IF (Guia.ID_MOTIVO = 8, Guia.COD_TIP_NIF_PROV, adq.COD_TIP_NIF_RECP)  as COD_TIP_NIF_DEST
			, IF (Guia.ID_MOTIVO = 8, Guia.TXT_RUC_DESTINATARIO, adq.NUM_IDEN_RECP) as NUM_RUC_DEST
			, IF (Guia.ID_MOTIVO = 8, Guia.TXT_NOMBRE_DESTINATARIO, adq.NOM_RZN_SOC_RECP) as NOM_RZN_SOC_DEST
            , Guia.NUM_RUC_PROV as NUM_RUC_PROV
			, Guia.NOM_RZN_SOC_PROV as NOM_RZN_SOC_PROV
			, Guia.COD_TIP_NIF_PROV as COD_TIP_NIF_PROV
            , Guia.TRANS_COD_TIP_NIF as TRANS_COD_TIP_NIF
            , Guia.TRANS_CONDUCT_COD_TIP_NIF
            , Guia.TRANS_CONDUCT_NUM_IDEN
    FROM 	tbl_guia_remision Guia INNER JOIN tbl_motivo_traslado Moti ON Guia.ID_MOTIVO = Moti.ID_MOTIVO
								   INNER JOIN tbl_adquiriente adq ON adq.ID_ADQ = Guia.ID_DESTINATARIO
    WHERE	Guia.ID_GUIA = pGUIA
		AND Guia.ID_EMISOR = pEMISOR
	ORDER BY Guia.FEC_EMISION DESC;
END ;;
DELIMITER ;
