CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_NUEVO_COD_SERIE`(
	  pSERIE varchar(10)
    , pEMISOR int
    , out pCODIGO varchar(12)
)
BEGIN
	UPDATE 	tbl_inv_serie
    SET 	NUM_SECUENCIA = (NUM_SECUENCIA + 1)
    WHERE 	TXT_SERIE = pSERIE
		AND ID_EMISOR = pEMISOR;
	
	
    SELECT 	CONCAT(LPAD((NUM_SECUENCIA), 8, '0')) INTO pCODIGO
    FROM 	tbl_inv_serie
    WHERE 	TXT_SERIE = pSERIE
		AND ID_EMISOR = pEMISOR;
END ;;
DELIMITER ;
