CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_PRODUCTOS_BY_CLIENTE_POS`(
IN pID_EMISOR INT
)
BEGIN
    SELECT 
		det.ID_PRODUCTO AS id_producto,
		prod.TXT_NOMBRE AS nombre_producto,
		prod.TXT_CODIGO AS codigo_producto,
		-- count(det.NUM_DET_CABECERA) AS items_vendidos
        '[][]' as posicion_matriz
	FROM tbl_cpe_cabecera cab 
	INNER JOIN tbl_cpe_det_cabecera det ON cab.NUM_CPE = det.NUM_CPE
	INNER JOIN tbl_producto prod ON det.ID_PRODUCTO = prod.ID_PRODUCTO
	WHERE 
		cab.COD_CLIENTE_EMIS = pID_EMISOR AND
		cab.COD_IDEN_CB <> 'C'
	GROUP BY det.ID_PRODUCTO
	-- ORDER BY items_vendidos DESC
	LIMIT 35;

END ;;
DELIMITER ;
