CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_PRODUCTO_BY_ID`(pId INT, pEmisor INT)
BEGIN
	SELECT 	  Prod.ID_PRODUCTO
			, Prod.TXT_CODIGO
			, Prod.TXT_CODIGO_ALT
			, Prod.TXT_CODIGO_SUNAT
			, Prod.TXT_NOMBRE
			, Prod.TXT_NOMBRE_ALT_1
			, Prod.TXT_NOMBRE_ALT_2
			, Prod.ID_CLASE
			, Prod.ID_FAMILIA
			, Prod.ID_SEGMENTO
			, Prod.ID_UNIDAD_MED
			, Prod.DEC_STOCK
			, Prod.DEC_STOCK_MIN
			, Prod.TXT_ESPECIFICACIONES
			, Prod.DEC_PRECIO
            , Prod.DEC_PRECIO_CON_IGV
			, Prod.COD_TIP_AFEC_IGV
			, Prod.BIT_SERIE
			, Prod.TXT_FOTO
			, Prod.CHR_ESTADO
            , Prod.DEC_PESO
            , Prod.ID_UNIDAD_PESO
            , Prod.BIT_CANT_ENTERO
            , Prod.BIT_INVENTARIO
	FROM 	tbl_producto Prod	
    WHERE	Prod.ID_PRODUCTO 	= pId
		AND Prod.ID_EMISOR 		= pEmisor;
END ;;
DELIMITER ;
