CREATE DEFINER=`root`@`%` PROCEDURE `SP_OBTENER_PRODUCTO_DISPONIBLE_BY_CODIGO_NOMBRE`(
	  pCODIGO VARCHAR(15)
    , pNOMBRE VARCHAR(100)
    , pUBICACION INT(11)
    , pEMISOR INT(11)
)
BEGIN
	SELECT 	DISTINCT Prod.ID_PRODUCTO AS Id
			, Prod.TXT_CODIGO AS Codigo
			, Prod.TXT_NOMBRE AS Nombre
            , Prod.ID_UNIDAD_MED AS CodUnidad
            , Unid.TXT_COD_UND AS Unidad
            , Prod.DEC_PRECIO AS Precio
            , Prod.DEC_PRECIO_CON_IGV as PrecioConIgv
            , IFNULL(Inve.NUM_CANTIDAD, 9999999) AS Disponible
            , IFNULL(Inve.TXT_LOTE, '') As Lote
            , IFNULL(DATE_FORMAT(Inve.FEC_VENCIMIENTO, "%d/%m/%Y"), '') AS Vencimiento
            , IFNULL(CONCAT(Alma.TXT_NOMBRE, ' - ', Ubic.TXT_NOMBRE), '') AS Ubicacion
            , IFNULL(Inve.ID_UBICACION, 0) AS CodUbicacion
            , Prod.COD_TIP_AFEC_IGV AS TipoIGV
            , Prod.DEC_PESO AS Peso
            , Prod.ID_UNIDAD_PESO AS UnidadPeso
            , CONCAT(Prod.DEC_PESO, ' ', UnPe.TXT_CODIGO) AS TXT_PESO
            , FU_COMBO_UNIDAD_ID_BY_PRODUCTO(Prod.ID_PRODUCTO) AS ComboUnidadID
            , FU_COMBO_UNIDAD_COD_BY_PRODUCTO(Prod.ID_PRODUCTO) AS ComboUnidadCOD
            , Prod.BIT_CANT_ENTERO AS SoloEntero 
            , Prod.BIT_INVENTARIO AS EsServicio
			, if (Prod.TXT_CODIGO_ALT = pCODIGO,1,0) as BusquedaBarCode
	FROM 	tbl_producto Prod 	LEFT JOIN tbl_inventario Inve 	ON Prod.ID_PRODUCTO = Inve.ID_PRODUCTO
								LEFT JOIN tbl_ubicacion Ubic	ON Inve.ID_UBICACION = Ubic.ID_UBICACION
								LEFT JOIN tbl_almacen Alma		ON Ubic.ID_ALMACEN = Alma.ID_ALMACEN AND Alma.ID_EMISOR = Inve.ID_EMISOR
                                INNER JOIN tbl_unidad_medida Unid ON Prod.ID_UNIDAD_MED = Unid.ID_UNIDAD
                                INNER JOIN tbl_unidad_peso UnPe   ON Prod.ID_UNIDAD_PESO = UnPe.ID_UNIDAD_PESO
    WHERE	
		(Prod.TXT_CODIGO LIKE concat('%',pCODIGO,'%') OR 
        Prod.TXT_CODIGO_ALT LIKE concat('%',pCODIGO,'%') OR 
        Prod.TXT_NOMBRE LIKE concat('%',pCODIGO,'%'))
		AND Prod.ID_EMISOR 		= pEMISOR
        AND Prod.CHR_ESTADO		= 'A'
        AND (Inve.NUM_CANTIDAD > 0 OR (Inve.NUM_CANTIDAD IS NULL AND Prod.BIT_INVENTARIO = 1))
        AND ( Ubic.ID_ALMACEN = pUBICACION OR pUBICACION = 0)
	ORDER BY Nombre, Ubicacion
    LIMIT 8;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
