CREATE DEFINER=`root`@`%` PROCEDURE `SP_QUITAR_GUIA_REMISION_DETALLE`(
	  pGUIA 		int(11)
	, pLINEA 		int(11)
)
BEGIN
	DELETE FROM tbl_guia_remision_detalle
    WHERE	ID_GUIA = pGUIA
		AND INT_LINEA = pLINEA;
	
	UPDATE 	tbl_guia_remision_detalle
	SET		INT_LINEA = INT_LINEA - 1
	WHERE	ID_GUIA = pGUIA
		AND INT_LINEA > pLINEA;
END ;;
